INSERT INTO `applicationforms` VALUES ('',3,'',''),('communications',1,'','Please choose an individual role within the Public Relations Department to apply for.'),('communications',3,'Public Relations Department','This department is responsible for establishing policies regarding the moderation of Cantr\'s satellite resources (forum, wiki, irc, webzine), maintaining these resources in order to best promote the free exchange of ideas between the players, promoting Cantr in order to gain more players, and, if needed, soliciting funds from the players to pay for Cantr\'s costs. Specific responsibilities of the Public Relations Department include moderating the public forums and our IRC channel, publishing our newsletter (ezine), supervising/assisting in maintaining and updating our Cantr Wiki, and acting as intermediaries between the Administration and the various language groups. Please see below each specific division of the Public Relations Department for a more detailed description, and individual applications for each. (If you are interested in being involved in more than one division, please only fill out the application for the one you are most interested in, and indicate on the last question which other areas you would wish to help with - any pertinent questions not already asked will be forwarded to you)'),('intro',2,'','For those who would like to assist in running this game, Cantr II is almost always looking for new staff members. As you can see on the departments page (link at the bottom of each page), the staff is organised in different groups, that each have different tasks. Below you can find a description of each department, or of specific tasks within each department. \r\n\r\nIf you are interested in any of those positions, you can use the button below the description, which will automatically send you an application form. Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce). \r\n\r\nThis is where the application procedure will start. This procedure can sometimes take some time, so be patient. When filling in the form, please avoid extremely brief answers, but also pages long essays. Note that you need to be able to read and write English to get involved in the staff.\r\nThe Game Administration Board and Finance Officer are recruited from existing staff and upon the initiative of the GAB. In other words, you can only be invited to those positions and applications will be ignored.'),('intro',3,'',''),('languages',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) Please give a little information about yourself: name, age, occupation, hobbies, etc.\r\n\r\n2) What elements of Cantr appeal to you the most? What have been your favourite episodes to date, involving your own characters?\r\n\r\n3) What languages are you fluent in, both written and spoken?\r\n\r\n4) What experience do you have with translation?\r\n\r\n5) Please translate the following texts into as many languages as you can:\r\nYou see a woman in her twenties. She is wearing leather shoes, a cotton shirt and a fur hat.\r\n\r\n\"Please note that it is not allowed to create a character in one language group, and then play it as if it belonged to another language group. If you spawn an English character it has to be able to communicate (somewhat) in English, and should be played as an English character.\"\r\n\r\n6) Do you have computer programming skills or knowledge of HTML language?'),('languages',3,'Public Relations Department (Translator)','Since the game is available in a number of different languages and most staff members are only fluent in English,\r\nwe need people that can translate between English and the other languages. A translator has two main tasks:\r\ntranslating correspondence or other texts upon request from other departments and translating the website itself. For\r\nthe letter, forms on the web are used. No specific knowledge is required, except for being fluent in both English and\r\nthe language you want to translate for.'),('liaison officer',1,'Liaison Officer','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) What is your age, and what real life experience do you have that might help you as a Liaison Officer?\r\n\r\n2) Why did you apply for this position?\r\n\r\n3) Name some positive things about yourself; qualities, skills...things you are proud of.\r\n\r\n4) What language other than English are you fluent in?\r\n\r\n5) Are you active in the forums in your language group?\r\n\r\n6) Part of being an LO is to pass along information from your language group to the rest of the staff in an impartial manner.  Are there any personal issues (with other players in your language group, etc.) that may impact your ability to do so?\r\n\r\n7) Part of being an LO is to recruit and manage other staff in your language group.  Do you perceive any problems being able to fulfill these vital roles?\r\n\r\n8) As a senior PR department member, you will have full authority to participate in any activity that the department covers.  Is there any aspect of the department that you feel either unwilling or unable to participate in?  Are there areas in which you have a great amount of interest?\r\n\r\n9) Are there any players from your language group that you would care to list as a reference?  Is there anyone who you would recommend that we not ask? (e.g. someone that has a grudge or dislikes you).'),('liaison officer',3,'Public Relations Department (Liaison Officer)','The Liaison Officer is a senior member of the Public Relations Department who is bilingual in English and another language used in Cantr.  They are responsible for recruiting and managing non-English speaking members of their language groups for all positions within the Public Relations Department, as well as communicating the needs and desires of their language groups to the Administration in an impartial manner.'),('marketing',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) Please give name, age, and a little information about yourself, such as job/interests/hobbies, etc.\r\n\r\n2) Why would you make a good member of the Public Relations Department, particularly with marketing?\r\n\r\n3) What resources would you use to bring new players into Cantr?\r\n\r\n4) Do you think Cantr appeals to a certain age group, or would you envision targeting a more general age range of potential players?\r\n\r\n5) Do you believe that merchandising would be an effective source of advertising? If so, which products would you like to see implemented?\r\n\r\n6) What do you think could be useful improvements in the area of the Public Relations Department?\r\n\r\n7) What experience do you have in terms of writing articles, interviews, or newsletters? Do you have any experience with developing/maintaining websites?\r\n\r\n8) Why did you apply for this position?\r\n\r\n9) Name some positive things about yourself; qualities, skills...things you are proud of. Elaborate how they show themselves.\r\n\r\n10) Name some negative things about yourself.\r\n\r\n11) Are you interested in applying for any other aspect of the work the Public Relations Department undertakes (IRC moderatorship, forum moderatorship, wiki sysop, etc.)?'),('marketing',3,'Public Relations Department (Marketing Specialist)','Cantr always tries to get more and more players, especially because the more active players, the more interesting\r\nthe game. Hence, good marketing is crucial. Next to developing new ideas for marketing the game, a key activity\r\nis to surf the web for other sites that might be related to Cantr and to \'spread the word\' and advertise Cantr on\r\nforums, sites, etc. Standard texts are available, hence the main requirement for a member of this department is simply\r\nenthousiasm and some activity in exploring the world outside Cantr where Cantr can be marketed.'),('moderator',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) What is your age, and what real life experience do you have that might help you with the Public Relations Department?\r\n\r\n2) Are you primarily applying for IRC moderatorship, forum moderatorship, something else, or several of those?\r\n\r\n3) What experience do you have with IRC and IRC moderating (operating)?\r\n\r\n4) How often/much are you generally on our IRC channel, and how often do you read or write on our forum? What times are you on IRC regularly (specify timezone)?\r\n\r\n5) What do you think of our current forum and IRC and the contribution to those of our players?\r\n\r\n6) What do you think could be useful improvements in the area of the Public Relations Department?\r\n\r\n7) What experience do you have in terms of writing articles, interviews, or newsletters? Do you have any experience with developing/maintaining websites?\r\n\r\n8) Why did you apply for this position?\r\n\r\n9) Name some positive things about yourself; qualities, skills...things you are proud of. Elaborate how they show themselves.\r\n\r\n10) Name some negative things about yourself.\r\n\r\n11) What elements of Cantr appeal to you the most? What have been your favorite episodes to date, involving your own characters?\r\n\r\n12) Have you had a conflict with another player in the past? About what, and how did it work out?\r\n\r\n13) Can you describe the four-day-rule and how you would moderate this without taking over the job of the PD?\r\n\r\n14) How might one distinguish between an obnoxious player and an obnoxious character?\r\n\r\n15) How would you deal with a player who consistently uses abusive language, to the clear irritation of other players?\r\n\r\n16) Are you fluent in any languages besides English?'),('moderator',3,'Public Relations Department  (Forum and/or IRC Moderator)','One role within the Public Relations Department is that of forum and IRC moderator. This job involves maintaining \r\nthe friendly and welcoming atmosphere of the forums and IRC channel by resolving any out-of-control conflicts and \r\nflaming, as well as removing spam. No experience with the game is required for this position, however prior activity\r\non the Cantr forum and IRC channel is preferred. Applicants should have clear, friendly online communications skills,\r\nshould be good mediators, and should know when and when not to use moderation to resolve conflicts. This position is \r\nnot generally very time-consuming if you are already active on the forum and IRC channel. Editorial Board and Wiki \r\nSysop department members are also moderators, but have additional roles.'),('personnel',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to BeepBeep or Pilot, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) What is your age, and what real life experience do you have that might help you as a Personnel Officer?\r\n\r\n2) Why did you apply for this position?\r\n\r\n3) Name some positive things about yourself; qualities, skills...things you are proud of.\r\n\r\n4) What elements of Cantr appeal to you the most? What have been your favorite episodes to date, involving your own characters?\r\n\r\n5) What do you think are the most important tasks of the Personnel Officer? How would you go about performing those tasks?\r\n\r\n6) How do you see the position of the Personnel Officer relative to the Game Administration Board?\r\n\r\n7) What methods would you apply to keep staff morale high?\r\n\r\n8) How would you approach a staff member who is clearly not doing his or her job properly?\r\n\r\n9) How do you think the fact that all staff members are volunteers affects how they should be approached / dealt with by the Personnel Officer?\r\n\r\n10) Are you fluent in any natural languages besides English?'),('personnel',3,'Personnel Officer','The Personnel Officer is responsible for handling all applications - in close cooperation with the GAB and the Chairs\r\nof the different departments, and in keeping track of the quality of the existing staff. A good Personnel Officer has\r\ngood communication skills, has a sense of how an organisation works, and how to keep staff members enthousiast and\r\nsatisfied with their position. This person must be able to keep things confidential and to mediate when conflicts between\r\nstaff members arise.'),('players',1,'','Fill this in, copy/paste it into a private message on the forum and send it to Pilot or BeepBeep, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) What is your age, and what real life experience do you have that might help you with the Players Department?\r\n\r\n2) Why did you apply for this position?\r\n\r\n3) Name some positive things about yourself; qualities, skills...things you are proud of.\r\n\r\n4) Name some negative things about yourself.\r\n\r\n5) What elements of Cantr appeal to you the most? What have been your favorite episodes to date, involving your own characters?\r\n\r\n6) Have you had a conflict with another player in the past? About what, and how did it work out?\r\n\r\n7) How might one distinguish between an obnoxious player and an obnoxious character?\r\n\r\n8 ) Are there any circumstances in which multiple characters of the same player working together are not violating the Capital Rule? Explain.\r\n\r\n9) Are you fluent in any languages besides English?'),('players',3,'Players Department','The Players Department handles all requests and questions by players that are not clearly related to any other\r\ndepartment and is responsible to handling applications by players and breaches of the Capital Rule or other bad\r\nplayer behaviour. The department is thus a mixture of a customer service and a detective / court system. Members\r\nof this department need to have clear and friendly email communication skills and need to have a perfect grasp of the\r\nCapital Rule. A good sense of what is acceptable and what is not in terms of player behaviour is crucial. Again,\r\nscreening is somewhat thorough.'),('programming',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) What is your age, and what real life experience do you have that might help you with the Programming Department?\r\n\r\n2) Why did you apply for this position?\r\n\r\n3) Name some positive things about yourself; qualities, skills...things you are proud of.\r\n\r\n4) What elements of Cantr appeal to you the most? What have been your favorite episodes to date, involving your own characters?\r\n\r\n5) What programming languages do you know and how well do you know them?\r\n\r\n6) What experiences do you have with relational and other databases?\r\n\r\n7) In terms of time, how much do you expect to be able to dedicate to this position, on average?\r\n\r\n8) Do you consider yourself a good team worker? Why?\r\n\r\n9) Are you fluent in any natural languages besides English?'),('programming',3,'Programming Department','The Programming Department is responsible for all bug repairs and writing all additions to the game (for as far as\r\nthey cannot be handled by the Resources Department). Cantr is written in PHP, using the support of a mySQL database,\r\nhence some knowledge of these two is a strong advantage. Both are easy to learn, however, when you already have a solid\r\nprogramming background or when you have enough time and enthousiasm to dedicate to learning them. The Programming\r\nDepartment will consider applications from people with no prior programming experience, given that the person has\r\nenough will, time, and enthousiasm to dedicate to learning to program. Because of the access privileges of a full\r\nmember of the department, every new member will first be named \'aspirant member\' with limited access, so that we can\r\nestimate the reliability of the new member. The department is interested both in people concentrating on bug repairs\r\nand in people concentrating on new development, or both. All new development has to be approved by the Chair, as the\r\nconcept of the game is very closely guarded.'),('resources',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\nRESOURCE DEPARTMENT APPLICATION QUESTIONNAIRE\r\n\r\n1. Share some basic biographical information about yourself.  (Age, location, job, school, etc) \r\n\r\n\r\n\r\n2. Share a few positive qualities about yourself. (works well in groups, creative, self-motivated, etc) \r\n\r\n\r\n\r\n3. Share a few negative qualities about yourself. (opininated and stubborn, long stretches of inactivity, etc) \r\n\r\n\r\n\r\n4. How much of the Cantr world do you get to see directly on a regular basis?  (how many characters do you play actively, how many islands do they live on, what language groups do you play in, etc.) \r\n\r\n\r\n\r\n5. Describe a few of the professions or character types you have played during your Cantr career.  What are some of your favorites? \r\n\r\n\r\n\r\n6. Resource Department is responsible for defining everything your character can gather, build, eat, and/or use.  Name a few things in the game that you feel could use some improvement. \r\n\r\n\r\n\r\n7. Name a few things that you think have been implemented very well and give some thoughts on why you think they improve the game. \r\n\r\n\r\n\r\n8. What kind of resources or items would you be interested in working on as a member of the Resources Department?  What sources of information would you use to help bring a balance of realism and playability to your projects? \r\n\r\n\r\n\r\n9. What do you feel are the major factors involved in determining the popularity, usefulness, or overall quality of a resource or item?  What basic strategies would you consider to decide how best to improve the game balance of an item or process? \r\n\r\n\r\n\r\n10. Do you feel that the mechanics of gathering, processing, and building unfairly encourage or inhibit the development of certain types of social elements (economy, security, combat, crime, etc)?  If so, what thoughts do you have on how to fix them?\r\n\r\n\r\n'),('resources',3,'Resources Department','This department is responsible for defining new types of objects, new types of raw materials, new types of vehicles,\r\nand new types of machines, and can make alterations in the allocation of resources in the game world. All changes are\r\nmade using forms on the website, which will be extensively explained before you will use them. Some are more technical\r\nthan others (e.g. the object types definition table), but there is definitely no need for any programming experience.\r\nWhat we really need here is people that are interested in surfing the web and reading up on real life production\r\nprocesses, so that the Cantr game can be made a bit more realistic. The department tries to keep an interesting balance\r\nin the game in terms of resources and building requirements and to keep a certain level of complexity in the industrial\r\nprocess in the game. So, if you are interested in thinking about how things should be produced, what steps are involved\r\nin an industrial process, etc., and you like to discuss those on the forum and devise new object and resource types,\r\nthis might be the department for you.'),('tailor',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\nRESOURCE DEPARTMENT APPLICATION QUESTIONNAIRE\r\n\r\n1. Share some basic biographical information about yourself.  (Age, location, job, school, etc) \r\n\r\n\r\n\r\n2. Share a few positive qualities about yourself. (works well in groups, creative, self-motivated, etc) \r\n\r\n\r\n\r\n3. Share a few negative qualities about yourself. (opininated and stubborn, long stretches of inactivity, etc) \r\n\r\n\r\n\r\n4. How much of the Cantr world do you get to see directly on a regular basis?  (how many characters do you play actively, how many islands do they live on, what language groups do you play in, etc.) \r\n\r\n\r\n\r\n5. Describe a few of the professions or character types you have played during your Cantr career.  What are some of your favorites? \r\n\r\n\r\n\r\n6. Resource Department is responsible for defining everything your character can gather, build, eat, and/or use.  Name a few things in the game that you feel could use some improvement. \r\n\r\n\r\n\r\n7. Name a few things that you think have been implemented very well and give some thoghts on why you think they improve the game. \r\n\r\n\r\n\r\n8. What kind of resources or items would you be interested in working on as a member of the Resources Department?  What sources of information would you use to help bring a balance of realism and playability to your projects? \r\n\r\n\r\n\r\n9. What do you feel are the major factors involved in determining the popularity, usefulness, or overall quality of a resource or item?  What basic strategies would you consider to decide how best to improve the game balance of an item or process? \r\n\r\n\r\n\r\n10. Do you feel that the mechanics of gathering, processing, and building unfairly encourage or inhibit the development of certain types of social elements (economy, security, combat, crime, etc)?  If so, what thoughts do you have on how to fix them?\r\n\r\n\r\n'),('tailor',3,'Resources Department - Tailor','The tailor is a member of the RD, but has a very specific role. One of the definitions just described is the definition\r\nof the different types of clothes. Writing their descriptions and defining what requirements are there to manufacture\r\nthem. The tailor will interact directly with players who can make requests for new clothes and discuss with them what\r\nwould be the right description. Here are combination is needed of some interest in how manufacturing processes are\r\nbuild up and some talent in writing fiction English (like, not as boring as my writing :) ...).'),('webzine',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) Please tell us a bit about yourself: What is your name? What is your age and occupation, and what timezone are you in? What are your general interests (eg. hobbies)?\r\n\r\n2) Why did you apply for this position?\r\n\r\n3) What experience do you have in terms of writing articles, interviews, or newsletters? Do you have any experience with developing/maintaining websites?\r\n\r\n4) Name some positive things about yourself; qualities, skills...things you are proud of. Elaborate how they show themselves.\r\n\r\n5) Name some negative things about yourself.\r\n\r\n6) What elements of Cantr appeal to you the most? What have been your favorite episodes to date, involving your own characters?\r\n\r\n7) Please edit the following sentence, paying close attention to all punctuation, spelling, and correct word usage in proper English:\r\n\r\na old man ran toward the water chassing after The boat laughin loudly lol\r\n\r\n8) Are you fluent in any languages besides English?\r\n\r\n9) Do you have computer programming skills, or knowledge of HTML language?\r\n\r\n10) Are you interested in applying for any other aspect of the work the Public Relations Department undertakes (marketing, IRC moderatorship, forum moderatorship, wiki sysop, etc.)?'),('webzine',3,'Public Relations Department (Editorial Board)','The Public Relations Department is also responsible for publishing our quarterly webzine. The Editorial Board\r\nfinds submissions, writes articles, conducts the webzine\'s interviews, and edits submitted content. Applicants for \r\nthe Editorial Board should have good writing, editing, and interviewing skills. This position sometimes requires \r\nquite a bit of time (when editing a submission, writing an article, releasing a new issue, or conducting an interview, \r\nfor example), but isn\'t demanding on a daily basis.'),('wiki',1,'','Fill this in, copy/paste it into a private message on the forum and send it to the Chair of the department to which you are applying, to Cdls, or send it to the personnel department via the webform on the contact page (direct mail will bounce).\r\n\r\n1) What is your age, and what real life experience do you have that might help you with the Public Relations Department (particularly with wiki editing)?\r\n\r\n2) Are you primarily applying for wiki management, something else, or more than one area of the Public Relations Department?\r\n\r\n3) What experience do you have with IRC and IRC moderating (operating)?\r\n\r\n4) How often/much are you generally on our IRC channel, and how often do you read or write on our forum? What times are you on IRC regularly (specify timezone)?\r\n\r\n5) What do you think of our current forum and IRC and the contribution to those of our players?\r\n\r\n6) What do you think could be useful improvements in the area of the Public Relations Department?\r\n\r\n7) What experience do you have in terms of writing articles, interviews, or newsletters? Do you have any experience with developing/maintaining websites?\r\n\r\n8) Why did you apply for this position?\r\n\r\n9) Name some positive things about yourself; qualities, skills...things you are proud of. Elaborate how they show themselves.\r\n\r\n10) Name some negative things about yourself.\r\n\r\n11) What elements of Cantr appeal to you the most? What have been your favorite episodes to date, involving your own characters?\r\n\r\n12) Have you had a conflict with another player in the past? About what, and how did it work out?\r\n\r\n13) Can you describe the four-day-rule and how would you moderate this without taking over the job of the PD?\r\n\r\n14) How might one distinguish between an obnoxious player and an obnoxious character?\r\n\r\n15) How would you deal with a player who consistently uses abusive language, to the clear irritation of other players?\r\n\r\n16) Are you fluent in any languages besides English?'),('wiki',3,'Public Relations Department (Wiki Management)','Other roles within the Public Relations Department are that of the wiki moderator and wiki administrator. The wiki \r\nadministrator is in charge of deciding how the information on the wiki should be organized, and is responsible for \r\ncommunicating with staff to obtain that information. The wiki moderator watches the wiki for errors and vandalism. \r\nFor these positions, applicants are preferred (though not required) to have experience with the Cantr wiki and \r\nMediaWiki editing knowledge.');
