  KEY `island` (`island`),
  KEY `region` (`region`),
  KEY `pos` (`type`,`x`)
) ENGINE=InnoDB AUTO_INCREMENT=72594 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
