sander Chrabaszcz <grkalk@gmail.com>','2014-08-13'),(1,1,'days_needed','Days needed:','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'death_old_age_are_you_sure','Are you sure you want this character to die of old age?','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-11-08'),(1,1,'decimal_separator',',','','Grzegorz Sojka <ghs@o2.pl>','2006-11-04'),(1,1,'degrees','degrees',NULL,'Judith Meyer <junesun@gmx.net>','2004-03-26'),(1,1,'dept_account_query','General queries and questions','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_account_query_description','','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_asd','Administrative Support Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_asd_description','','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_bug_report','Reporting bugs','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_bug_report_description','','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_communications','Communications Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_communications_description','','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_gab','Game Administration Board','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_gab_description','This board is responsible for the daily overall administration of the game. All other councils and departments are responsible to this board. See for details the <a href=\"index.php?page=constitution\">Cantr II Constitution</a>.','','Fredrik B. <fredrik@cantr.org>','2011-11-16'),(1,1,'dept_gac','Game Administration Council','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_gac_description','','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_languages','Languages Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_languages_description','','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_marketing','Marketing Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_marketing_description','This department has three main purposes: Social outreach, marketing, and social moderation.\r\n<p>\r\nAs Cantr is a global game played by people of many languages, the PR department employs translators and language group Liaison Officers to facilitate good communication between the language groups and staff. Translators are responsible for translating ingame texts and global announcements, and for assisting other departments in communications with players. Liaison Officers manage administrative tasks for their language groups, such as the hiring of staff, and also communicate the language group\'s needs to the GAB (and vice-verse). <br>\r\nMarketers are tasked with promoting Cantr within their language group.<br>\r\nFinally, moderators ensure compliance with the rules within Cantr\'s social media (forum, irc, wiki, etc). <br>\r\nMembers of this department can specialize, or perform as many functions as they are comfortable with. ','','Fredrik B. <fredrik@cantr.org>','2011-11-16'),(1,1,'dept_personnel','Personnel Department','','Chris Johnson <cj.cantr@gmail.com>','2007-01-20'),(1,1,'dept_players','Players Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_players_description','This department is responsible for ensuring that Cantr\'s <a href =\"http://wiki.cantr.net/index.php/Game_Rules\">rules</a> are being followed by the players. They are also there to assist players with questions regarding the rules, to receive reports of rule violations, to restore deactivated accounts, accept new players, and assist with password or email address changes.','','Fredrik B. <fredrik@cantr.org>','2011-11-16'),(1,1,'dept_PR','Public Relations Department','','Ilona Hyvttinen <okarrdess@yahoo.com>','2009-12-03'),(1,1,'dept_programming','Programming Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_programming_description','This department is responsible for adding to and maintaining the source code of Cantr II. It also administrate all technical aspects of running the game, such as databases, web servers, domains, technical forum and wiki issues, among other things. Its members also help support players with technical issues in the game.','','Fredrik B. <fredrik@cantr.org>','2011-11-16'),(1,1,'dept_resources','Resources Department','','Chris Johnson <cj.cantr@gmail.com>','2006-10-04'),(1,1,'dept_resources_description','This department is responsible for the organisation of raw materials in Cantr. This includes managing the list of raw material types and the locations of the different resources. The basic aim should be stimulating an interesting economy. The resources department works closely together with the programming department in managing the list of manufacturable objects in the game. The animals subdepartment will be responsible for the management of the list of animals in the same way as the whole department is for raw materials. The Tailor is responsible for handling requests for new cloth design.','','Fredrik B. <fredrik@cantr.org>','2011-11-16'),(1,1,'dept_support','Technical Support (Players & Programming)','','Pilot  <pilot.cantr@gmail.com>','2016-04-23'),(1,1,'dept_support_description','This department will contain all staff members that perform tasks to support the Game Administration Board and other departments. <br>\r\nPersonnel Officers are responsible for spotting problems among the Cantr staff and will handle applications for staff positions. If you have questions about becoming a staff member, or if you are a staff member and experience problems as such, please contact this department using link below.<br>\r\nThe Finance Officer is responsible for the bookkeeping of Cantr and handling donations. If you have questions or want to send donations, please use our contact form.<br>\r\nThe Development Monitor is responsible for maintaining the flow of ideas from suggestion to implementation, with the goal of keeping ideas from stagnating and getting buried.','','Fredrik B. <fredrik@cantr.org>','2011-11-16'),(1,1,'desc_chars_left','chars left','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-08-13'),(1,1,'desc_pick_the_lock_1','You tried to open a lock, but you don\'t have the right key to do it. You do have a','','Pilot  <alf_pilot@yahoo.com>','2012-03-12'),(1,1,'desc_pick_the_lock_2','If you click the button below you will try to pick the lock','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-18'),(1,1,'desc_pick_the_lock_3','at','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-18'),(1,1,'desc_pick_the_lock_4','Your try will take a whole day and your success depends on chance.','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-18'),(1,1,'desc_recycling_1','You are trying to disassemble this','','Stefan Liedtke <Stelior@gmx.de>','2010-02-22'),(1,1,'desc_recycling_2','Are you sure? The project can be cancelled later.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-12-24'),(1,1,'det_brandnew','brand new','','Judith Meyer <junesun@gmx.net>','2005-08-22'),(1,1,'det_crumbling','crumbling','','Judith Meyer <junesun@gmx.net>','2005-08-22'),(1,1,'det_new','new','','Judith Meyer <junesun@gmx.net>','2005-08-22'),(1,1,'det_often-used','often-used','','Judith Meyer <junesun@gmx.net>','2005-08-22'),(1,1,'det_old','old','','Judith Meyer <junesun@gmx.net>','2005-08-22'),(1,1,'det_used','used','','Judith Meyer <junesun@gmx.net>','2005-08-22'),(1,1,'digging_slot_summary','#USED# out of #TOTAL# resource slots are used','','Chris Johnson <chris.johnson@ida.co.uk>','2006-02-15'),(1,1,'disclaimer_too_drunk','You are falling down drunk. That means you\'re unable to do most things. Talking is enabled for roleplaying reasons but please play with your character\'s current state in mind.','','Ilona Hyvttinen <okarrdess@yahoo.com>','2011-07-24'),(1,1,'dist_fairly_close_by','fairly close-by','','Aleksander Chrabas