items you are carrying. <B>Location</b> shows details about your current location. <B>Vehicles and Buildings</b> shows what structures are in the area. The <B>People</b> button lists other people who you can see. Remember in Cantr, all other characters are played by real people, but they may not be online at this moment in time. <B>Objects</b> shows items such as resources, notes, machines and tools on the ground and the final <B>Activities</b> button lists the projects set up by players in this location. You can talk to other characters using the <B>Talk to all</b> box below these buttons. Further information about the user interface can be found in the Cantr II Wiki. Enjoy your time and have fun. The events below are a summary of what you can see by clicking on the main buttons above.</i>','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'event_198','You notice <CANTR CHARNAME ID=#ACTOR#> whom you haven\'t seen before.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'event_199','The project you were working on is not where you are','','Chris Johnson <cj.cantr@gmail.com>','2006-11-20'),(1,1,'event_2','<CANTR CHARNAME ID=#ACTOR#> says to you: \"#MESSAGE#\"',NULL,'Judith Meyer <junesun@gmx.net>','2004-07-08'),(1,1,'event_20','You turned around.',NULL,'Judith Meyer <junesun@gmx.net>','2004-07-08'),(1,1,'event_200','You have to be on a boat at sea or on a lake to work on #PROJECT#.','','Chris Johnson <cj.cantr@gmail.com>','2006-12-03'),(1,1,'event_201','You have to be on a moving boat at sea or on a lake to work on #PROJECT#.','','Chris Johnson <cj.cantr@gmail.com>','2006-12-03'),(1,1,'event_202','You have to be on a non moving boat at sea or on a lake to work on #PROJECT#.','','Chris Johnson <cj.cantr@gmail.com>','2006-12-03'),(1,1,'event_203','You have to be on a docked boat on  #PROJECT#.','','Chris Johnson <cj.cantr@gmail.com>','2006-12-03'),(1,1,'event_204','You have to be on a parked vehicle to work on  #PROJECT#.','','Chris Johnson <cj.cant