b?szcz <grkalk@gmail.com>','2012-01-16'),(1,1,'form_vegetation_group','Vegetation group',NULL,'Jos Elkink <jos@cantr.net>','2003-03-13'),(1,1,'form_weapon','Weapon',NULL,'Jos Elkink <jos@cantr.net>','2004-03-25'),(1,1,'form_website','Website',NULL,'Jos Elkink <jos@cantr.net>','2003-03-06'),(1,1,'general_info_01','On this page you can find some general info on how this game works. Some basic concepts - travelling, projects, etc. - will be explained. If you are still having questions, just send a note to <a href=#GMASTERADDRESS>me</a> and if anyone comes with questions to you, just refer to this page.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_02','Please note that this page might sometimes be a bit out-of-date.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_03','Below you will find some information about the different features of this game - that is, part of the things that I programmed into the game that create the environment in which the game takes place. However, I should not start with all those technical possibilities, but with the general idea behind the game. Playing the game now for 77 days I noticed that most players focus completely on those things described below - digging, travelling, building, etc. - while they seem to forget about the main part, namely creating a society.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_04','By using the talk buttons on the characters page and by writing notes and spreading them, it is possible to communicate with other characters. Only when you communicate and work together the game will get interesting. If you do everything by yourself, everything will go slow and take lots of time. For example, building a simple house takes 28 days and more than 33 days of digging for stone. That means you will be working on it for two months (!). However, if you work together with others, you can reduce it tremendously. Two people already means half of the time. Another example would be if you want to build something more complicated than a house. You will often need raw materials that are not available on the location where you are. If you now start searching all by yourself, you will be travelling for ages before you found all raw materials. However, by exchanging information about where you have been and what you have seen, a group of people can much faster get an idea of what to find where. Or even better, if one person tries to trade by digging for a certain raw material and transporting it to a more densily populated location, other characters on this location can get at the material much faster. In other words, creating an economy will speed up the game enormously.','','Wiktor Obr?bski <psychowico@gmail.com>','2012-07-06'),(1,1,'general_info_05','So, to keep it short, cooperate and communicate, as those are the essential parts of the game. There are many different ways of organising cooperation (one dictator who rules over all other characters, a nice democratic constitution, a communist-like economy or a free market, barter trade or a banking economy - all are possible in this game) - you can just try them out. You can imagine the Cantr universe as one big social experiment where you can try out different ways of organising society and the economy.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_06','The only thing you have to keep in mind always when you play is the \"capital rule\" as explained on the page before you log in. Information about locations that you didn\'t travel to, you can find by communicating with other characters that did, not by travelling with one of your other characters to that location and then assume that all your characters know what this one character saw. The only way of communication is talking and notes (letters, newspapers, etc.) - there are no mental links, telephones, whatever.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_07','The world of Cantr exists of a lot of locations. Those locations are of a certain type - grass, hills, mountains, etc. -, contain certain raw materials and have certain exists. When you are on a location, you can talk to all the people that are on the same location or you can build something or dig something up. When you have the characters page on screen, you can look under the heading \"description\" and there you will find what kind of location you are on. By clicking on one of the little icons in front of a raw material, you start a project (see below) to get some of that material. The picture on the right tells you what kind of area you are in.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_08','If you look a little lower on that page, you will find a list of all characters that are currently on that location. You can talk to each of them by clicking on the icon in front of their name, or you can talk to all of them by clicking on the larger version of the same icon in the player menu. When something is not really private, it is to be preferred to talk to all instead of to one personally, as that makes it more interesting to see for others what is happening.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_09','On a location there can be buildings. When you click on the icon in front of a building on the characters page, you enter the building. This does not take any time. Inside the building, it is just like being on another location - there will again be people there and you can talk to them or you can do other things. Buildings are useful for several reasons: you can (soon) lock them, so that you can store things that you can\'t all bear at the same time; you can talk to a group of people, without having to have everybody there listening to you (people outside the building won\'t hear you) and you can store food without having it taint (which it does when it\'s laying outside). There will probably be more uses in the nearby future.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_10','Travelling is moving from one location to another. Thus not from one room inside a building to another, but outside. You start a travel by clicking on the icon in front of an exit road on the characters page. By default you start walking. Currently walking speed is 10, but is negativily dependent on the weight of the objects you have in your inventory. Distances between locations differ, but vary from 3 to about 140, with an average of 40. So that means that it takes on average 4 days to travel from one location to the other if you walk without objects in your inventory. A day in Cantr is as long as a day in real life. The computer processes all travels and projects (see below) currently eight times a day. This means that if your speed is 10 and the distance 3, you will arrive approximately 9 hours later. So travelling takes a lot of time. Right now that means there is little to explore or it takes weeks, but when there are more buildings, there is more to explore on one location (going in and out buildings does not take extra time), and travelling will get faster over time as there are other ways of transport than walking. It is, by the way, possible to turn around while travelling.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_11','To make travelling faster it will is possible to build vehicles, which is a general term I use for all cars, ships or airplanes. Yes, all of those will be possible over time. With all of those it will be possible to travel to other locations faster - obviously. They will also all need adjustments, though. You can only use a car after you improved a path to a road. And you can only use a ship after you built a harbor. Vehicles will be somewhat comparable to buildings - you can see them, enter them, talk to the people inside, etc. And while you\'re inside you can start travels to other locations.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_12','Travelling by boat or by plane will only be possible when a starting location and an end location have both made the same improvements to the location. Thus, when you built a harbor in one coastal city there will be not effect, but as soon as another coastal city builds a comparable harbor, suddenly both of them will get a new exit listed so that they can travel to eachother. The same counts for airfields.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_13','An important aspect of the game are the projects. When you dig something up, improve a road, start a manufacturing project, etc. - all of those are called projects. A project is started by one player, but will be visible for all players at the bottom of the characters page. There you can click on the info button to see who is working on the project, what materials are needed for the project, and how much progress has been made. And what tools are needed to work on it. With the other button you can join the project. That is, if you are not working on another project yet, you can start working on this one. A project always takes a certain number of days. By working with more people on it, it will go faster. Note that you need to have the required tools in your inventory, or your participation will be registered, but useless.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_14','When a digging (or farming, collecting, etc.) or manufacturing project has been finished, the result will usually appear \"on the ground\" - that is, in the \"objects\" part of the location. That means that everybody on that specific location can pick it up - it will not automatically end up in the inventory of the initiator of the project. Thus, when you farm on a busy location, chances are high that someone else will take the food your produced. So be careful :) ... Also note that food will taint if you do not pick it up.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_15','Turns for projects work at the same moment as those for travelling. Currently that means they are all processed 8 times a day. (In some more detail: the amount of days required has been multiplied by 8 in the computer and every turn the computer looks how many people with the right tools are working on the project and deduces that number from the number of required turns. When 0 is reached, the project is finished.) This also means that you only have to work on the project when the computer processes the turn. So you can drop a project, walk into a building and talk a bit, walk back, and join the project again, without losing working time on the project.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_info_16','There are different kinds of food. All of them work the same way - you take them in your inventory (take them up from the ground or get them from a fellow character) and once a day the computer deduces the amount of food you need from your inventory. Thus you don\'t have to do anything to eat, you only have to have it in your inventory. If you do not have enough food, your strength will go down. It differs per product how much food you need a day. Also note that all kinds of grain (wheat, sorghum, etc.) are not finished food products - they will be of use as soon as I programmed bakeries into the game.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_17','There is also a second type of food. This is food that is not useful for your daily food consumption, but you can use it to gain strength when you lost some. You can click on the \"eat\" icon in front of the food and enter the amount of food you want to eat.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'general_info_18','When you reach strength 0, you will die. There will in due time be other ways to loose strength then not eating. When violence has been programmed into the game, it will have effects on strength, and I also intend to program diseases and pollution into the game. But none if this exists yet. Currenly a low strength has no effect yet on your productivity or travel speed. It will have effect on your fighting skills and might get new effects later on.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_title_1','General idea of the game','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_title_2','Travelling','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_title_4','Vehicles','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_title_5','Projects and building','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'general_title_6','Food and health','','Grzegorz Sojka <ghs@o2.pl>','2006-11-07'),(1,1,'gram','gram',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'grams_of','grams of',NULL,'Judith Meyer <junesun@gmx.net>','2005-01-03'),(1,1,'grams_of_raw','#AMOUNT# grams of <CANTR REPLACE NAME=raw_#RAW#>','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-02-16'),(1,1,'header_animals','Animals','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-09-13'),(1,1,'hours','hours',NULL,'Jur Schagen <jurschagen@hotmail.com>','2005-02-07'),(1,1,'improve_road','Improving road to <CANTR LOCNAME ID=#DEST#>, Upgrade to <CANTR REPLACE NAME=road_#TYPE#>','','Chris Johnson <chris.johnson@ida.co.uk>','2006-03-30'),(1,1,'info_animals_title','ANIMALS','','Chris Johnson <cj.cantr@gmail.com>','2006-11-07'),(1,1,'info_copy_note','Notes in ASCII format cannot be copied. If you are getting blank copies, convert the note to UTF-8 format by viewing the note and using the format conversion link in the upper right hand corner. If the note truncates after conversion, convert back to ASCII, then convert to a different encoding that does not truncate the text. The note should then be copyable.','','Fredrik B. <fredrik@cantr.org>','2010-12-10'),(1,1,'info_email_address_problem','We have detected a problem with your email address.<br>\n<br>\nPlease check if you have correctly entered it in your account settings. Also please check for any Cantr mail in your  spam folder, and move it to your inbox.<br>\nIf this is done, click <a href=\"#SEND_CONFIRMATION#\">here</a> to send a link to reactivate your mail for the game.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-02-26'),(1,1,'info_no_html_allowed','no HTML allowed','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-01-01'),(1,1,'ingest_all_old_text','You are going to consume the contents of <CANTR OBJNAME ID=#OBJECT# TYPE=1>. Are you sure?','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-01'),(1,1,'ingest_all_old_title','Eating from dishware','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-06-14'),(1,1,'intro_anniversary','Now celebrating 10 years online!','','Fredrik B. <fredrik@cantr.org>','2012-06-19'),(1,1,'intro_buy_credits','On this page you can use your credits to buy extra minutes. Those minutes will be added to your total immediately and do not roll over to the next day, so be cautious when using your credit. Prices are subject to change.','','Jos Elkink <jos@cantr.net>','2006-10-22'),(1,1,'intro_category_content','Content','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_category_login','Log in to the world of Cantr','','Joshua Mathias <Joshuamonkey@gmail.com>','2015-08-12'),(1,1,'intro_category_news','News','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_charname_test_character','test character','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-02'),(1,1,'intro_link_contact','contact support','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_link_forum','forum','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_link_irc','irc channel','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_link_passreminder','Lost password?','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-03'),(1,1,'intro_link_register','join the game','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-08-25'),(1,1,'intro_link_screenshots','screenshots','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_link_tutorial','tutorial','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_link_twitter','Follow us on Twitter','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_link_wiki','cantr wiki','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_login','Login:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_main_title','Welcome to Cantr II!','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_page_1','Welcome to Cantr II. Please make a choice below, or read the game description on this page.',NULL,'Cosmo Harrigan <cosmo@cantr.net>','2003-11-24'),(1,1,'intro_page_descriptionlink','Description and background',NULL,'Jos Elkink <jelkink@cantr.net>','2003-03-04'),(1,1,'intro_page_forumlink','Cantr Discussion Forum',NULL,'Jos Elkink <jelkink@gmail.com>','2004-10-26'),(1,1,'intro_page_irclink','Cantr II Discussion Channel',NULL,'Jos Elkink <jelkink@yahoo.com>','2004-10-17'),(1,1,'intro_page_loginlink','<b>Login</b>','','Robert Wilinski <gedzilla@wp.pl>','2005-10-20'),(1,1,'intro_page_note','<p>Cantr II is a <b>persistent browser-based role-playing game</b> (PBBRPG), in which a large number of players play an even larger number of characters who all together form different societies all over our virtual world. Societies exist in different languages, whereby all language groups play in the same virtual world.\r\n\r\n<p>Playing always <b>from the perspective of each individual character</b>, you can try to play the world\'s most famous politician, most feared criminal, most cunning military commander, most wealthy entrepreneur or most beloved village idiot. <b>Any role you can imagine</b> you can play in this game and the challenge is in playing it consistently and in achieving the goals you set for your characters individually.\r\n\r\n<p>Cantr II is a <b>slow-paced game</b>. Many players only play for a few minutes per character each day and one meeting can take a week to play. The game is designed for players who have more on their agenda than just gaming. However, you can start <b>up to fifteen characters</b> and when they are all heavily involved in their respective communities, they will give you enough to do for a full-time job as player! Be warned, many players experience Cantr II as being very <b>addictive</b>! ;)\r\n\r\n<p>Although some experience in a language is needed before one can play in that language group, the game can be used very well to <b>practice your language skills</b> in a second language. Just play one or two characters in a non-native language and you\'ll be surrounded by people talking the language you are learning. Or you can play a character and so once in a while take a step back and observe what kind of societies you see forming, which can be very <b>educational</b>.\r\n\r\n<p>Note that we are in the process of translating the website in different languages. If you use the website in a language other than English, you will still most likely encounter a lot of English.\r\n\r\n<p><CENTER>The gamemaster</center>','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'intro_page_userlink','New user',NULL,'Jos Elkink <jelkink@cantr.net>','2003-03-04'),(1,1,'intro_page_webzinelink','\"Stolen Notes\" (Cantr Webzine)','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'intro_page_wikilink','Cantr II Wiki',NULL,'Jos Elkink <jos@cantr.net>','2005-07-23'),(1,1,'intro_password','Password:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_select_language','Select language','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_subtitle','A text-based role-playing game','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-08-12'),(1,1,'intro_text_1','Cantr II is a 100% free, persistent browser-based role-playing game (PBBRPG) where the world, its cultures, societies, history, religions, buildings and objects are all created by players, playing as the characters that inhabit that world.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-08-11'),(1,1,'intro_text_2','Considered by many to be a slow-paced game, Cantr offers the possibility for enjoyment even with limited playing time. However, if slow isn\'t your style, you can play up to 15 unique characters, and it\'s up to you how far they are involved in each of their communities. With a rich, living history and support for sixteen languages, the possibilities in Cantr are almost endless.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-08-11'),(1,1,'intro_text_3','Play as a politician, a pirate, a poet, a feared conqueror, a trader, an artisan, a courtesan, or as an explorer in an ever-changing world that is affected by the choices you make in game.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-08-11'),(1,1,'intro_text_gamemaster','The Gamemaster','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'intro_video','','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-10-29'),(1,1,'intro_wiki_firstday_link','especially check out <a href=http://wiki.cantr.net/index.php/Your_First_Cantr_Day>this page</a> before you begin','','Fredrik B. <fredrik@cantr.org>','2010-11-23'),(1,1,'intro_wiki_language_link','http://wiki.cantr.net/index.php/Main_Page','','Fredrik B. <fredrik@cantr.org>','2010-11-22'),(1,1,'inventory_multiple_notes','Operations on multiple notes','','Grzegorz Sojka','2006-06-11'),(1,1,'inventory_show_all','Show all','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'inventory_show_coins','Show coins','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'inventory_show_keys','Show keys','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'inventory_show_notes','Show notes','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'inventory_show_raws','Show raws&items',