sander Chrabaszcz <grkalk@gmail.com>','2015-10-01'),(1,1,'mail_idleout','Greetings,\r\n\r\nYou have been unsubscribed from Cantr II due to not logging in for too long a time.\r\nYou are welcome anytime to return simming on this game - just go to https://www.cantr.net and contact game support to have your account reactivated.\r\n\r\nJos Elkink (this is an automatically sent message)','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-12-24'),(1,1,'mail_idleout_title','Cantr II - account idled out','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-12-24'),(1,1,'mail_idleout_warn','Have you forgotten about Cantr?\r\n\r\nYour characters #CHARS# are waiting for your guidance!\r\nYou have not visited the Green World for #IDLE_DAYS# days,\r\nbut you can still log into www.cantr.net to avoid account removal.\r\nI look forward to see you in the game!\r\n\r\nJos Elkink\r\n\r\n(this is an automatically sent message)','','Joshua Mathias <Joshuamonkey@gmail.com>','2016-10-19'),(1,1,'mail_idleout_warn_title','Cantr II - account removal warning','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-12-24'),(1,1,'mail_intro_idleout','Greetings,\r\n\r\nYour intro account in Cantr II has expired due to not logging in for a long time.\r\nYou are welcome to try again anytime. If you would like to do so, please register again at <a href=\"https://cantr.net\">https://cantr.net</a>\r\n\r\nJos Elkink\r\n\r\n(this is an automatically sent message)','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-09-18'),(1,1,'mail_intro_idleout_title','Cantr II - account has expired','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-18'),(1,1,'mail_intro_idleout_warn','Greetings,\r\n\r\nA couple of days ago you registered an account for the game Cantr II. We sent you an activation email, although we have noticed that you still haven\'t entered the game.\r\nIf you want to give it a try, please <a href=\"#LOGIN_LINK#\">follow this link</a> and confirm account transfer.\r\nIf you don\'t want to play the game, sorry to see you go.\r\n\r\nJos Elkink\r\n\r\n(this is an automatically sent message)','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-23'),(1,1,'mail_intro_idleout_warn_title','Cantr II Registration Reminder','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-17'),(1,1,'mail_reactivation_email','Hello,\r\nThank you for your decision to reactivate your Cantr account registered with this email address.\r\nAccount username is \'#USERNAME#\' (ID: #ID#)\r\n\r\nTo request reactivation, please enter the following link: <a href=\"#LOGIN_LINK#\">#LOGIN_LINK#</a>\r\n\r\nIf you don\'t remember your password, you can use the password reminder: <a href=\"#PASSREMINDER_LINK#\">#PASSREMINDER_LINK#</a>\r\n\r\n\r\nIf you don\'t know why the email was sent, please report it to support@cantr.net','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-03-21'),(1,1,'mail_text_email_confirmation','<a href=\"#CONFIRMATION_LINK#\">Click here</a> to confirm the email address.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-02-26'),(1,1,'mail_title_email_confirmation','Confirmation of your email address','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-02-27'),(1,1,'mail_title_reactivation_email','Cantr account reactivation','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-03-21'),(1,1,'mail_turn_report_footer','Overall statistics:\r\n   Number of players: #PLAYERS#\r\n   Number of characters: #CHARS#\r\n\r\nEnd report\r\n\r\n--------------------------------------------------------------\r\n\r\nThere is also a forum for out-of-character discussion of \r\nthis game. You do not have to join this list to play the game,\r\nbut it is strongly encouraged. This forum will make playing\r\nmore interesting as you know better what is going on and you can\r\nbe involved when new features of the game are being discussed.\r\nTo subscribe to the forum, just log into the Cantr website and\r\nfollow the link to the out-of-character-discussion.\r\nIf that link doesn\'t work for you, you can directly access the\r\nforum using the link http://www.cantr.net/forum .\r\n\r\nIt is possible to play Cantr in languages other than English. If you\r\nwish to do so, contact the languages department. All emails will\r\narchived and as soon as there are enough people for a certain language,\r\na starting location for that language will be opened. Of course, to\r\nplay in a certain language, one needs a reasonable proficiency in\r\nreading and writing in that language. In principle, any language is\r\npossible, from classical Latin to Esperanto.\r\n\r\nIf you do not want to receive these reports anymore and want\r\nto unsubscribe from the game, you can do so manually by log-\r\nging in into the website and use the unsubscribe button.\r\n\r\nRegards,\r\n\r\nJos Elkink\r\nChairman Game Administration Council\r\n\r\n(this is an automatically sent message)\r\n','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-08-10'),(1,1,'mail_unsubscribe_text','Greetings,\r\n\r\nYou have been unsubscribed from Cantr II. You are welcome anytime to return simming on this game - just go to https://cantr.net.\r\n\r\nJos\r\nGM Cantr\r\n\r\n(this is an automatically sent message)\r\n','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-09-09'),(1,1,'manufact_cloth_piece_desc','Description','','Grzegorz Sojka <ghs@o2.pl>','2006-11-09'),(1,1,'manufact_cloth_piece_name','Name','','Grzegorz Sojka <ghs@o2.pl>','2006-11-09'),(1,1,'mass_production_info','You can select how many products should be created by this project. Project requirements and time will be multiplied as well.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-01-02'),(1,1,'mass_production_number','Number of products:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-01-02'),(1,1,'max_can_buy','Maximum you can buy','','Jos Elkink <jos@cantr.net>','2006-10-22'),(1,1,'message_crash_oct_09_2006','Due to a system crash on Monday October 9th we have had to set the game back to the same state it was on Friday 6th October. If you are a new player who registered since that time you will have to register again. Apologies for the inconvenience<br>Chris Johnson, Game Administration Board',NULL,'Chris Johnson <cj.cantr@gmail.com>','2006-10-09'),(1,1,'message_other_account_reactivated','Hi #NAME#,\r\n\r\nInstead of creating a new account, your already existing account with ID #ACCOUNT_ID# has been reactivated.\r\n\r\nThis account is now linked with the email address #EMAIL#. If you don\'t remember your password, please use the \"Lost password?\" link located on the Cantr II main page.\r\n\r\nIf you have any trouble accessing your account or have questions, please contact the Players Department via the support form or send an email to players@cantr.net\r\n\r\nWelcome back!\r\n\r\n#ADMIN#\r\n\r\n(This is an automatically created message)','','Pilot  <pilot.cantr@gmail.com>','2016-04-24'),(1,1,'message_other_account_reactivated_subject','Your account #ACCOUNT_ID# has been reactivated','','Joshua Mathias <Joshuamonkey@gmail.com>','2016-04-21'),(1,1,'message_reactivation_approved','Dear #NAME#,\r\nYour reactivation request has been approved!\r\n\r\nYou can now login to your account (ID: #ACCOUNT_ID#) on <a href=\"#MAIN_PAGE_LINK#\">#MAIN_PAGE_LINK#</a>.\r\nIf you don\'t remember the password, you can reset your password using <a href=\"#PASSWORD_PAGE_LINK#\">the password reminder</a>.\r\n\r\nYours,\r\n#ADMIN#\r\n\r\n(This is an automatically created message)','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-07-30'),(1,1,'message_reactivation_approved_subject','Cantr account reactivated','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-07-28'),(1,1,'message_reactivation_refused','Dear #NAME#,\r\n\r\nUnfortunately your request to reactivate your account with ID #ACCOUNT_ID# has been refused for the following reason(s):\r\n\r\n#REASON#\r\n\r\nPlease contact us using support form on Cantr website or by email (players@cantr.net) if you think this decision is a misunderstanding.\r\n\r\nYours,\r\n#ADMIN#\r\n\r\n(This is an automatically created message)','','Pilot  <pilot.cantr@gmail.com>','2016-07-31'),(1,1,'message_reactivation_refused_subject','Cantr account reactivation refusal','','Pilot  <pilot.cantr@gmail.com>','2016-07-31'),(1,1,'message_refused_any_reason','Hi #NAME#,\r\n\r\nUnfortunately, your attempt to create a new player account on\r\nCantr II has not been accepted. The reason for this is:\r\n\r\n#REASON#\r\n\r\nIf you disagree with this decision, please send an email to\r\nsupport@cantr.net and explain what is happening.\r\n\r\nYours,\r\n\r\n#ADMIN#\r\n\r\n(This is an automatically created message)',NULL,'Jos Elkink <jos@cantr.net>','2005-06-10'),(1,1,'message_refused_double_account','Hi #NAME#,\r\n\r\nUnfortunately, your attempt to create a new player account on Cantr\r\nII has not been accepted. The reason for this is that you already\r\nseem to have an account and you are only allowed to have one.\r\n\r\nIf this decision is based on a misunderstanding, please contact\r\nsupport@cantr.net.\r\n\r\nYours,\r\n\r\n#ADMIN#\r\n\r\n(This is an automatically created message)',NULL,'Jos Elkink <jos@cantr.net>','2005-06-10'),(1,1,'message_refused_double_application','Hi #NAME#,\r\n\r\nUnfortunately, your attempt to create a new player account on Cantr\r\nII has not been accepted. The reason for this is that you seem to be creating two applications and you are only allowed to have one account.\r\n\r\nIf this decision is based on a misunderstanding, please contact\r\nsupport@cantr.net.\r\n\r\nIt might be that you created a second account because your other application contained an incorrect email address. In this case also please contact support@cantr.net.\r\n\r\nYours,\r\n\r\n#ADMIN#\r\n\r\n(This is an automatically created message)',NULL,'Jos Elkink <jos@cantr.net>','2005-06-10'),(1,1,'message_refused_proxy','Hi #NAME#,\r\n\r\nUnfortunately, your attempt to create a new player account on Cantr II has not been accepted due to the suspected use of some means of anonymisation like a proxy server, virtual private network, or other anonymity program such as Tor. It is required that new accounts be registered from a real and transparent IP address. Applications being posted using any kind of anonymous or public connection will not be accepted.\r\n\r\n\r\nIf this decision is based on a misunderstanding, please contact\r\nplayers@cantr.net\r\n\r\nYours,\r\n\r\n#ADMIN#\r\n\r\n(This is an automatically created message)','','Sanchez  <zezc@ymail.com>','2016-08-17'),(1,1,'message_refused_subject','Cantr account refused',NULL,'Jos Elkink <jos@cantr.net>','2005-06-10'),(1,1,'meta_description','Cantr is a textbased simulation, which tries to create a reallife society in a virtual country, named Cantr. The society, with all its institutions, will be created, by and through the players. Politics, economy, etc. will be reinvented.','','Jos Elkink <jos@cantr.net>','2008-04-22'),(1,1,'meta_keywords','textbased,simulation,politics,economy,virtual,internet,game,society,characters,roleplay,society simulator,language learning','','Joshua Mathias <Joshuamonkey@gmail.com>','2015-07-25'),(1,1,'minutes','minutes','','Jos Elkink <jos@cantr.net>','2006-10-22'),(1,1,'multinotes_all','All','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-03-11'),(1,1,'multinotes_none','None','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-03-11'),(1,1,'multinotes_reverse','Reverse','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-03-11'),(1,1,'multinotes_take_notes_button','Take notes','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-03-31'),(1,1,'multinotes_title','Multinotes tool','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-03-11'),(1,1,'name_steed_of',' of','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-03-22'),(1,1,'near_death_die','Die','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-12-19'),(1,1,'near_death_suicide_accept','Yes, I can no longer bear the suffering','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-01'),(1,1,'near_death_suicide_are_you_sure','Are you sure you want to die now? Pain is terrible, but as long as you are alive there\'s hope to be saved.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-02'),(1,1,'new_building_desc','New description','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-07-11'),(1,1,'new_building_desc_accept','Change it!','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-07-11'),(1,1,'new_player_warning','Before you start to play Cantr, make sure you read the following Wiki page: <a href=http://wiki.cantr.net/index.php/Your_First_Cantr_Day target=blank>Your First Cantr Day</a>!','','Fredrik B. <fredrik@cantr.org>','2010-11-23'),(1,1,'note_description','Here you can write a note which will be stored in your character\'s inventory. The text will, when read, be interpreted as an HTML text. This is almost like normal text, but you can add a few layout codes. Also note that if you set this note to \"not editable\" at the bottom, you will not be able to restore this setting.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'note_editable','editable','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'note_not_editable','not editable','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'note_preview','Preview','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-02-18'),(1,1,'note_select_enc','Select good one:','','Grzegorz Sojka <ghs@o2.pl>','2010-01-10'),(1,1,'note_setting','Setting','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'note_set_enc','Set','','Grzegorz Sojka <ghs@o2.pl>','2010-01-10'),(1,1,'note_store','Store','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'note_title','Title','','Wojciech Dorosz <wdorosz@gmail.com>','2006-03-21'),(1,1,'note_wrong_enc','Wrong encoding?','','Grzegorz Sojka <ghs@o2.pl>','2010-01-09'),(1,1,'notification_char_death','Your character #NAME# died.','','Kevin  <kevinsuspendedingaffa@gmail.com>','2015-12-12'),(1,1,'no_help_available','Unfortunately, for this page no help is available.',NULL,'Jos Elkink <jelkink@gmail.com>','2004-11-24'),(1,1,'no_search_results','There are no results fitting your description.',NULL,'Judith Meyer <junesun@gmx.net>','2005-08-20'),(1,1,'number_abbr','n','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-07-04'),(1,1,'object_desc_enter_desc','Please enter desired description:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-08-12'),(1,1,'object_desc_guidelines','<ul>\r\n<li>It\'s not permitted to set descriptions which are inconsistent with the object name. Descriptions are usually single-language only, so it should be possible to roleplay without fully understanding them.</li>\r\n<li>It\'s not permitted to set descriptions which make the object more similar to an object of another type than the described object is (for example, a cotton shirt cannot be long sleeved, because we have the object long sleeved cotton shirt. However long sleeved cotton shirt can \"lose\" sleeves when they are affected by significant roleplay matters [ragged during the battle]).</li>\r\n<li>Object descriptions shouldn\'t mention additional materials which are not used for manufacturing the object (for example bone earrings can\'t have anything about gold or iron in their description).</li>\r\n<li>Object descriptions shouldn\'t be changed dramatically (the length of a bone spear shouldn\'t change from 3\' to 6\'), but even significant changes are allowed if they are correctly roleplayed (a blue coat can become a red coat if you RP the dyeing process). Generally \"ragged\" object descriptions shouldn\'t become \"brand new\" in the description.</li>\r\n<li>Descriptions, like character descriptions, should describe only objective characteristics of the item. No implying other people\'s actions. (Bad description example: \"These earrings are so nice that you constantly look at them.\"). It also is not permitted to describe actions done with the object (especially when it\'s not a piece of clothing). Bad description example: \"This sword is always in the hands of its bearer.\" That would look strange when lying on the ground. It would also be strange in the inventory of a character who has no hands. Such detailed descriptions belong in the character\'s decription. One exception is clothing items: you can assume clothing is worn in a conventional manner. For example, you can expect gloves to be worn on the hands.</li>\r\n<li>It should be easy to distinguish between the description of the object itself and text written on an object\'s label. For example, the description \"red bottle\" is ambiguous. It could mean that the bottle is red or that the bottle has a label that says \"red bottle\". Instead, you could use *red bottle*, *a big bottle with a label*, or \"big bottle with the label: \'red bottle\'\".</li>\r\n</ul>','','Pilot  <pilot.cantr@gmail.com>','2015-01-25'),(1,1,'object_desc_guide_title','Object descriptions guidelines','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-02-08'),(1,1,'object_desc_select_object','And select object you want to change:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-08-12'),(1,1,'object_in_use','in use','','Chris Johnson <cj.cantr@gmail.com>','2006-10-17'),(1,1,'obj_freq_info','freq. #FREQ#','','Grzegorz Sojka <ghs@o2.pl>','2008-04-10'),(1,1,'old_age_death_are_you_sure','Are you sure? This decision is final and can\'t be undone.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-02-08'),(1,1,'old_age_death_counter','(can confirm death at #DAY#-#HOUR#:#MINUTE#)','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-02-08'),(1,1,'old_age_die','Die of old age','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-02-08'),(1,1,'or','or','','Grzegorz Sojka <ghs@o2.pl>','2007-01-06'),(1,1,'organisation_contact','Contact this department','','Grzegorz Sojka <ghs@o2.pl>','2006-11-03'),(1,1,'organisation_desc1','Below you will find an overview of the departments that are installed to run the Cantr II game. If you have questions, comments or suggestions about the game, please use our <a href=#CONTACTLINK#>contact page</a>. It will be appreciated if you first check which department comes closest to your question and then write to that department instead of writing immediately to the Support Departments.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-04'),(1,1,'organisation_desc2','Do you have bugs to report? Please visit our <a href=https://www.cantr.net/index.php?page=contact>bug report system</a>.','','Chris Johnson <cj.cantr@gmail.com>','2007-11-03'),(1,1,'organisation_desc3','If you want to help in running the game, that is of course very much appreciated. In such case please use our <a href=#RECRUITLINK#>recruitment page</a>.','','Grzegorz Sojka <ghs@o2.pl>','2006-11-04'),(1,1,'organisation_forum_nick','Forum nick','','Grzegorz Sojka <ghs@o2.pl>','2006-11-03'),(1,1,'organisation_irc_nick','IRC nick','','Grzegorz Sojka <ghs@o2.pl>','2006-11-03'),(1,1,'organisation_staff_member_name','Name','','Grzegorz Sojka <ghs@o2.pl>','2006-11-03'),(1,1,'organisation_staff_member_position','Position','','Grzegorz Sojka <ghs@o2.pl>','2006-11-03'),(1,1,'organisation_staff_position_open','OPEN','','Grzegorz Sojka <ghs@o2.pl>','2006-11-03'),(1,1,'page_4_day_rule','It is not allowed to discuss events Out Of Character with other players that might influence any ongoing action.<br>\r\nConcluded events such as character deaths may not be discussed OOC in the forums, IRC, or private communications for a minimum of four days.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-12-21'),(1,1,'page_accept_same_email','Removed/refused players with the same e-mail','','Jos Elkink <jos@cantr.net>','2007-01-23'),(1,1,'page_accept_same_email_part','Players with the partial email match','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-03-10'),(1,1,'page_accept_same_ip','Other players with the same IP number','','Jos Elkink <jos@cantr.net>','2007-01-23'),(1,1,'page_accept_same_ip_part','Other players with the same IP number part','','Jos Elkink <jos@cantr.net>','2007-01-23'),(1,1,'page_accept_same_name','Other players with the same first or lastname','','Jos Elkink <jos@cantr.net>','2007-01-23'),(1,1,'page_accept_same_password','Other players with the same password','','Jos Elkink <jos@cantr.net>','2007-01-23'),(1,1,'page_adduser_1','On this page you can subscribe as a new player to Cantr II. Note that all information you enter below (except password) will be visible to the game administrators, but will not be shared with any other person, organisation or company.<br>\r\nThe information below is about you, as a player. Information about your characters is on the bottom of the form.<br>\r\nPlease fill in the fields below:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-04-16'),(1,1,'page_adduser_2','Your login ID for this game will be mailed after you have filled in this form. Hence, without submitting a valid email address, you will not be able to log in.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-04-16'),(1,1,'page_adduser_3','One of the development plans of Cantr II is to introduce different language versions of the website. This will be a gradual process of translating it piece by piece. So, although you will not see the difference on the short term, we would like to know in what language you would like to be addressed.\r\n',NULL,'Jos Elkink <jos@cantr.net>','2003-03-04'),(1,1,'page_adduser_4','Password','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-04-16'),(1,1,'page_adduser_5','To make Cantr II as interesting as possible, it is important to have a large number of players. For that reason we want to advertise the game as effective as possible. Having a good idea of where our players are coming from would help in that effort. Could you describe for us how you found Cantr II? If you were referred to the game by a link on the internet, please tell us the site that referred you to Cantr. If you don\'t remember, that is of course not a problem.\r\n',NULL,'Jos Elkink <jos@cantr.net>','2003-03-04'),(1,1,'page_adduser_6','Reference to Cantr',NULL,'Jos Elkink <jos@cantr.net>','2003-03-04'),(1,1,'page_adduser_7','Additional comments','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-04-16'),(1,1,'page_adduser_8','Next to a player account, you should also create a character to play the game. You can here start one or two characters to start with. Later on, you can add more characters. You can choose a language other than English to play your character in. Some of the site will still likely be in English (since the status of translation varies from language to language and new things are often added), but your character will read, talk, write, etc. in the language you specify. Note, also, that it is required that you can read/write somewhat fluently in this language before you start playing such a character. If you want to play a character in a language other than the ones listed below, please contact us using <a href=\"index.php?page=contact\">support form</a> before you start the character. Note that there are specific rules concerning starting new language groups, so it will require a minimum of four players before it\'s considered.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-17'),(1,1,'page_adduser_necessary','necessary','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-03-30'),(1,1,'page_adduser_refplayer','Refering player ID','','Jos Elkink <jos@cantr.net>','2006-03-31'),(1,1,'page_adduser_refplayer_desc','In case a player of Cantr referred you to the game, please enter that player\'s login ID below. This will result in the player being credited with recruiting a new player.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'page_add_char_confirm','Please confirm the information below.',NULL,'Thomas Pickert <thomas@cantr.net>','2004-06-26'),(1,1,'page_add_char_intro','About naming your character: The name will be unknown to others until you actually introduce your character and it can be changed if need be, but generally you\'re encouraged to use a realistic name (as opposed to something like a username). Also do not include any ranks or titles since they would have no value.<br>\r\nNote that there\'s a limit to the number of characters you can play at a time. This limit is tied to the number of days you have been subscribed to Cantr and it caps at 15. Characters who die at a young age will block a slot for a period of time to discourage suicidal activities.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'page_add_char_language','You may choose a language other than English to play your character in <b>if</b> you\'re at least somewhat fluent in that language. Your character is not allowed to speak, read, write in or understand any other language than the one you registered him or her with, unless (s)he encounters speakers of another language in the game and you actively roleplay a language learning process for a minimum of two years. So choose wisely.<br>\r\nAlso note that when playing in languages other than English, some parts of the interface will still be in English since everything hasn\'t been made available for translation. Hopefully this doesn\'t ruin your gaming experience.<br>\r\nIf you want to play a character in a language other than the ones listed below, please contact using <a href=\"index.php?page=contact\">support form</a> before you start the character.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-17'),(1,1,'page_adjust_speed_1','Your current speed is #CURRSPEED# percent of the maximum speed. You can enter here your new speed, with a maximum of 100 percent and a minimum of 0 percent.','','Pilot  <alf_pilot@yahoo.com>','2012-02-10'),(1,1,'page_alter_sailing_1','This vessel is currently sailing in direction #DEGREE# at a speed of #CURRENTSPEED# percent of its maximum speed. Possible directions:<BR><BR>\r\n0 = north<BR>\r\n90 = east<BR>\r\n180 = south<BR>\r\n270 = west<BR>\r\n360 = north<BR>\r\n<BR>\r\nYou can use any direction between 0 and 360 degrees. You can also set the number of turns (remember there are #TURNS# turns a day) you want to keep going like that. If you set it to 0 turns, you will keep going until you reach a coast.',NULL,'Judith Meyer <junesun@gmx.net>','2004-03-26'),(1,1,'page_building_destruction_text','This will take time based on destruction time of main building and all its extensions. Finishing destruction will turn building and all its extensions into ruins, so it will be possible to see people inside. All fixed objects inside will be destroyed, too and projects will disappear. The rest will remain unharmed.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-10-18'),(1,1,'page_buildmenu_1','Choose a category:','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'page_buildmenu_2','Select this category','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'page_buildmenu_3','Choose an object (<CANTR REPLACE NAME=category_#CATEGORY#>)','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'page_buildmenu_4','Select this object','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'page_buildmenu_5','Build this object','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'page_buildmenu_select','Please make your choice:','','Grzegorz Sojka <ghs@o2.pl>','2007-03-12'),(1,1,'page_build_menu_1','Enter the name of your building/vehicle below. Please be aware that afterwards the name can only be changed by using one of the sign altering tools (a chisel, a carving knife or a paintbrush), so be sure to check you have it just the way you wanted before adding resources to the project.','','Ilona Hyvttinen <okarrdess@yahoo.com>','2008-05-09'),(1,1,'page_build_objneeded','#AMOUNT2# total items required, #AMOUNT3# items still needed','','Doug R. <chippiemoose@gmail.com>','2010-07-01'),(1,1,'page_build_participate','Register your participation to this project','','Judith Meyer <junesun@gmx.net>','2006-03-25'),(1,1,'page_build_rawneeded','#AMOUNT2# total grams required, #AMOUNT3# grams still needed','','Doug R. <chippiemoose@gmail.com>','2010-07-01'),(1,1,'page_build_remove','Remove this project','','Judith Meyer <junesun@gmx.net>','2006-03-25'),(1,1,'page_cancel_docking','The ship <CANTR LOCNAME ID=#SHIPNAME#> is currently docking to <CANTR LOCNAME ID=#TARGET#>.  To cancel the docking process click on the continue button below.','','Chris Johnson <chris.johnson@ida.co.uk>','2006-04-11'),(1,1,'page_change_location_1','The current name of this place is #NAME#. Enter the new name:',NULL,'Jos Elkink <jos@cantr.net>','2005-04-25'),(1,1,'page_change_signs_1','This location has the following signs:','','Jos Elkink <jos@cantr.net>','2007-01-10'),(1,1,'page_chardesc_title','CHARACTER DESCRIPTION',NULL,'David Goodwin <cantr@fuse.net>','2004-01-04'),(1,1,'page_confirm_unsubscribe_1','Are you sure you want to unsubscribe?',NULL,'Jos Elkink <jos@cantr.net>','2003-05-20'),(1,1,'page_confirm_unsubscribe_2','If you do so, you will lose your characters and login ID. You can always come back, but your characters cannot be recovered anymore.<BR><BR>The forward button below will continue your removal from the game; the back button will cancel it.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-20'),(1,1,'page_confirm_unsubscribe_3','READ THE ABOVE CAREFULLY BEFORE USING ANY OF THOSE BUTTONS',NULL,'Jos Elkink <jos@cantr.net>','2003-05-20'),(1,1,'page_createfield_1','You can use this form to set up a new field creation project. You do not have to determine its size yet - this will depend on the amount of work you or others put into it. Please select a type of usage for the field and name the field.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-09'),(1,1,'page_desc_borders_lake','Borders a lake.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_borders_sea','Borders a sea.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_docking','This vessel is currently docking. (#DOCKING#%)',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_door','Door to',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_floating','This vessel is currently floating on a <CANTR REPLACE NAME=areatype_#TYPE#>.','','Fredrik B. <fredrik@cantr.org>','2012-09-04'),(1,1,'page_desc_lighthouse_1','You see lighthouse #DESC# at direction #DEGREE#.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_lighthouse_2','You see a lighthouse at direction #DEGREE#.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_no_dock','You are not close to any place where you could dock.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_no_vessels_visible','None visible','','Chris Johnson <chris.johnson@ida.co.uk>','2006-02-09'),(1,1,'page_desc_places_dock','Places that are close enough to dock',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_desc_sailing','This vessel is currently sailing on a <CANTR REPLACE NAME=areatype_#TYPE#> in direction #DIRECTION#, at #SPEED# percent speed.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-10-03'),(1,1,'page_desc_signalfire','You see smoke towards direction #DEGREE#','','Chris Johnson <cj.cantr@gmail.com>','2007-01-17'),(1,1,'page_dig_1','Note that in one day one person can only #ACTION# #PERDAY# gram. The number of turns will be rounded upwards. The end result will have a random deviation (max 20%) of the amount you ask for.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-15'),(1,1,'page_dig_2','If you have <CANTR REPLACE NAME=item_#TYPE#_o>, you can #ACTION# #PERDAY# grams a day.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-01-27'),(1,1,'page_drop_1','The maximum amount you can #ACTION# is #WEIGHT#','','Fredrik Bekken <fredrik@cantr.org>','2010-05-15'),(1,1,'page_eatraw_1','You need #NEED# grams of <CANTR REPLACE NAME=raw_#TYPE#> to get back to 100 percent strength. You have #WEIGHT# grams of <CANTR REPLACE NAME=raw_#TYPE#>, so the maximum amount you can now eat is #MAX# grams.',NULL,'Jos Elkink <jos@cantr.net>','2003-05-20'),(1,1,'page_eatraw_1e','You need #NEED# grams of <CANTR REPLACE NAME=raw_#TYPE#> to get back to 0 percent tiredness. You have #WEIGHT# grams of <CANTR REPLACE NAME=raw_#TYPE#>, so the maximum amount you can now eat is #MAX# grams.',NULL,'Chris Johnson <chris.johnson@ida.co.uk>','2006-05-24'),(1,1,'page_eatraw_2','You have #WEIGHT# grams of <CANTR REPLACE NAME=raw_#TYPE#> and there\'s #CAPACITY# grams of space left in your stomach, so the maximum amount you can eat is #MAX# grams.',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-06-30'),(1,1,'page_eatraw_3','Consuming this substance would give you:',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-07-28'),(1,1,'page_eatraw_amount','Amount to eat:','','Grzegorz Sojka','2006-06-13'),(1,1,'page_eatraw_energy','Energy',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-08-28'),(1,1,'page_eatraw_health','Health',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-08-28'),(1,1,'page_eatraw_max','To maximize the following stat(s) you would need to eat...',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-08-28'),(1,1,'page_eatraw_nothing','You couldn\'t maximize any stats by eating this substance, either because your stats are already at maximum or it doesn\'t work that way.',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-08-28'),(1,1,'page_eatraw_nutrition','Nutrition',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-08-28'),(1,1,'page_events_speak_to','Speak to: ','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-10-23'),(1,1,'page_faq_0','The Frequently Asked Questions have been divided into three sections, for easier reference:\r\n        <OL>\r\n           <LI><a href=index.php?page=faq&action=1&s=#SESSION#&l=#LANG#>Questions that are related to the player OOC</A>, for example about the rules, the minutes, the staff... click here also if you don\'t know what \"OOC\" is.</LI>\r\n          <LI><A HREF=index.php?page=faq&action=2&s=#SESSION#&l=#LANG#>Questions that are related to in-game stuff</A>, for example game mechanics or phenomena that your character might see.</LI>\r\n          <LI><A HREF=index.php?page=faq&action=3&s=#SESSION#&l=#LANG#>Questions not directly related to Cantr</A>, for example how to set up IRC.</LI>\r\n        </OL><BR>\r\nNew players are encouraged to read through all of the FAQ, as well as the <A HREF=http://www.cantr.net/index.php?page=adduser&s=#SESSION#&l=#LANG#>Guide for New Players</A> (if it wasn\'t already read during the registration process) and the wiki article <A HREF=http://wiki.cantr.net/index.php/Your_First_Cantr_Day>Your First Cantr Day</A>. In general, the <A HREF=http://wiki.cantr.net/index.php/Main_Page>Cantr Wiki</A> can answer a lot of questions that you may have.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-03-04'),(1,1,'page_faq_1','<b>Game-related questions - OOC</b>   (Last update: March 28th, 2010)<br><br><ol>\r\n<li><a href=#1>What is the Capital Rule? I don\'t understand its function.</a></li><br>\r\n<li><a href=#2>What are OOC and IC?</a></li><br>\r\n<li><a href=#3>OOC and IC things: What they are and what they should be.</a></li><br>\r\n<li><a href=#4>Is it okay to use OOC in the game?</a></li><br>\r\n<li><a href=#5>On top of the screen it says \"<i>You have 2000 minutes left to play this turn. Make sure you log out when not playing for a while.</i>\" / On the player info it says something about \"Time left\". What does that mean?</a></li><br>\r\n<li><a href=#6>How can I have more characters?</a></li><br>\r\n<li><a href=#7>Am I allowed to have more than one account?</a></li><br>\r\n<li><a href=#8>Is account sitting or account sharing allowed?</a></li><br>\r\n<li><a href=#9>Why are some of my characters coloured white and others gray?</a></li><br>\r\n<li><a href=#10>How much does Cantr II cost to play?</a></li><br>\r\n<li><a href=#11>How can I contribute to the game?</a></li><br>\r\n<li><a href=#12>What priviledges do the staff members receive?</a></li><br>\r\n<li><a href=#13>How can I request a feature into the game?</a></li><br>\r\n<li><a href=#14>I\'ve found a bug in the game! / Something isn\'t right!</a></li><br>\r\n<li><a href=#15>What are the Cantr forums? What am I allowed to say on them?</a></li><br><br></ol><br><br>\r\n\r\n<ol>\r\n<li><a name=1></a><b>What is the Capital Rule? I don\'t understand its function.</b><br>\r\nThe Capital Rule, summarized, is: \"One may not use Out Of Character (Real Life) knowledge regarding in-game mechanics or events within the game (In Character) to advance yourself or others.\"<br> \r\nThe Capital Rule is a very broad rule and covers a lot of events that could happen, and also covers a lot of questionable events within the game. The simple thing to remember is: \r\nIf your characters work together, this is wrong. If you know something your character does not and use that information in game, this is wrong. If you cheat somehow between your characters, this is wrong.<br> \r\nFeel free to e-mail the Players Department support@cantr.net with any questions about the Capital Rule. If you feel someone has broken the Capital Rule, you are always welcome to post on the <a href=http://forum.cantr.org/viewforum.php?f=4>Capital Rule Breaches Forum</a>.</li><br><br>\r\n\r\n<li><a name=2></a><b>What are OOC and IC?</b><br>\r\nOOC is a short form for \"Out Of Character\", meaning in real life. IC is short for \"In Character\", meaning in game life.</li><br><br>\r\n\r\n<li><a name=3></a><b>OOC and IC things: What they are and what they should be.</b><br> \r\nEverything regarding your characters and the world they live in is IC. Everything regarding you, the player as a real person, is OOC. The user interface of the game and things like the manufacturing menu are completely OOC as a character cannot see this menu, but merely \"know\" what he can build. Consequentially everything referring to Cantr and its world as a game and everything about clicking buttons, being online and similar things is OOC.</li><br><br>\r\n\r\n<li><a name=4></a><b>Is it okay to use OOC in the game?</b><br>\r\nIt is encouraged that all OOC chatter remains OUT of the game because otherwise it ruins the role playing atmosphere for the other players. If it cannot be avoided completely, it should at least stay in whispers between the players and be marked with an \"OOC\" put in front. Notice, though, that whispers can be overheard by other characters in the location with a certain chance.</li><br><br>\r\n\r\n<li><a name=5></a><b>On top of the screen it says \"<i>You have 2000 minutes left to play this turn. Make sure you log out when not playing for a while.</i>\" / On the player info it says something about \"Time left\". What does that mean?</b><br> \r\nIn the past, there was a limit of 200 minutes per day per player, but some time ago this limit has been raised to 2000 minutes per day per player. As a day has only 1440 minutes, this means there isn\'t any limit at all anymore and you can ignore anything related to this. The only exception is the very first day of a new player which actually still is limited to 200 minutes.</li><br><br>\r\n\r\n<li><a name=6></a><b>How can I have more characters?</b><br>\r\nYou start off with a maximum of two characters when you first sign up, and you\'re allowed one more character for every day you play the game to a maximum of fifteen total characters. You can not receive any more characters than this.</li><br><br>\r\n\r\n<li><a name=7></a><b>Am I allowed to have more than one account?</b><br>\r\nNo, only one account per player is allowed.</li><br><br>\r\n\r\n<li><a name=8></a><b>Is account sitting or account sharing allowed?</b><br>\r\nNo, both of these aren\'t allowed. If you will be gone for some time, you can simply set your account \"on leave\" for up to 90 days. It won\'t be deactivated due to inactivity in this time (but your characters still can starve or be attacked). If you will be gone for longer than 90 days without the opportunity to log in, you can contact the PD to find a solution to keep your account nevertheless.</li><br><br>\r\n\r\n<li><a name=9></a><b>Why are some of my characters coloured white and others gray?</b><br> \r\nThis is to show you if something has happened since you last checked that character. A white colored character is one where something has happened, and you\'ve yet to check. A gray colored one is the opposite - nothing has happened since you last checked. There is a bug or problem with this, however. When you create a new character, the character will always be lit up white until something actually does happen and you check it.</li><br><br>\r\n\r\n<li><a name=10></a><b>How much does Cantr II cost to play?</b><br>\r\nCantr II is a free game and will always be free for people to play! Because it\'s a free game and there are costs involved, donations are always welcome!</li><br><br>\r\n\r\n<li><a name=11></a><b>How can I contribute to the game?</b><br>\r\nIf you wish to donate money to Cantr II, log into the game and below the list of your characters and the links for voting, there are several PayPal donation buttons, both for monthly subscriptions and for donating just a single time. You can contact support@cantr.net in order to donate via some other way or if you have any questions regarding donations.<br>\r\nIf you wish to contribute without donating money, it is possible to apply for a staff position in the paragraph \"Staff Recruitment\" just below the donation buttons. Also, players are always more than welcome to help out on the forums with people\'s questions and concerns about the game. And of course it is also helpful to vote for Cantr II on the voting sites that are linked below the list of your characters, so Cantr will get more players.</li><br><br>\r\n\r\n<li><a name=12></a><b>What priviledges do the staff members receive?</b><br>\r\nThe staff members dedicate their time helping Cantr II and they receive NO benefits for their work, except the acknowledgement and thanks from the players and other staff members.</li><br><br>\r\n\r\n<li><a name=13></a><b>How can I request a feature into the game?</b><br>\r\nThe best way to do this is to post on the <a href=http://forum.cantr.org/viewforum.php?f=2>Cantr II Suggestions Forum</a>. It would be advisable, though, to search it first before making a new post, as many people make suggestions that have been made many times before.<br>\r\nRemember, even if you suggest something, that does not mean it will be implemented into the game. The decision is based on whether the suggestion fits into the Cantr world, is technically realizable and on what the other players think about it.</li><br><br>\r\n\r\n<li><a name=14></a><b>I\'ve found a bug in the game! / Something isn\'t right!</b><br>\r\nPlease post the bug on the <a href=http://forum.cantr.org/viewforum.php?f=3>General Support Forum</a>. If you notice a bug that could possibly be abused by other players, please send a description of the bug to the support support@cantr.net instead. If you encounter a problem that isn\'t a bug, feel free to post on the Support Forum, too.</li><br><br>\r\n\r\n<li><a name=15></a><b>What are the Cantr forums? What am I allowed to say on them?</b><br>\r\nThe Cantr II forums, located at <a href=http://forum.cantr.org>forum.cantr.org</a>, allow all the players to come together, give suggestions, tell problems or just talk to the other players freely.<br>\r\nYou\'re always welcome to speak your mind, but there are, as always, rules that must be followed. You are not allowed to tell anything about your experiences in the game itself within four days after the event. Furthermore, you are not allowed to post any ingame maps within the forums, never. And although this hasn\'t been etched into stone, we would like to keep swearing in the forums to a minimum - there are children and sensitive adults that play this game, too.</li></ol><br><br>','','Fredrik B. <fredrik@cantr.org>','2013-01-29'),(1,1,'page_faq_2','<b>Game-related questions - In-game</b> (Last update: November 10, 2013)<br><br><ol>\r\n<li><a href=#1>Are there any matters of role-playing etiquette unique to Cantr that should be observed?</a></li><br>\r\n<li><a href=#2>Is my character allowed to speak more than one language?</a></li><br>\r\n<li><a href=#3>How do I make ... ?</a></li><br>\r\n<li><a href=#4>How do I remember who someone is? After I name them, does everybody else see that name?</a></li><br>\r\n<li><a href=#5>Why isn\'t anyone answering me?</a></li><br>\r\n<li><a href=#6>How can I participate in a project?</a></li><br>\r\n<li><a href=#7>How do I use a tool/an object/a resource on a project?</a></li><br>\r\n<li><a href=#8>What happens to my project if I enter a building/vehicle while I\'m working?</a></li><br>\r\n<li><a href=#9>How many grams of ... does my character eat a day?</a></li><br>\r\n<li><a href=#10>My character has meat/corn/fish/apples/coconuts etc., but doesn\'t eat them each day! Why not?</a></li><br>\r\n<li><a href=#11>My character has eaten a multiple of what he normally eats of the same food per day! Is this a bug?</a></li><br>\r\n<li><a href=#12>What\'s a gram? How many grams can a character carry?</a></li><br>\r\n<li><a href=#13>I started a project to collect 100 grams of something, but now my character has more or less than 100 grams. Why?</a></li><br>\r\n<li><a href=#14>It says my character is working on a project awkwardly/novicely/efficiently/skillfully/expertly. What does that mean?</a></li><br>\r\n<li><a href=#15>Can I improve my character\'s skills?</a></li><br>\r\n<li><a href=#16>I put some resources on the ground and now a part of them is gone although nobody picked some of them up. What happened?</a></li><br>\r\n<li><a href=#17>My character has a tool that should speed up the gathering of a resource, but it nevertheless says that he needs as long for the project as it would take a person without the tool. Why?</a></li><br>\r\n<li><a href=#18>My project is at 100%, but still not finished. Why?</a></li><br>\r\n<li><a href=#19>Why can\'t I cancel a project?</a></li><br>\r\n<li><a href=#20>Someone said \"OOC: (message)\". What does that mean?</a></li><br>\r\n<li><a href=#21>How can I whisper to somebody?</a></li><br>\r\n<li><a href=#22>What is dragging? When my character drags someone, why does it seem to never progress at turn change?</a></li><br>\r\n<li><a href=#23>The dragging is over 100%, but still isn\'t successful. Why?</a></li><br>\r\n<li><a href=#24>On the character selection screen, what do \"P\", \"D\" and \"T\" mean?</a></li><br>\r\n<li><a href=#25>How do these bars on the character description screen work? / How can I get rid of damage/tiredness/hunger?</a></li><br>\r\n<li><a href=#26>How long is one Cantr day? How does Cantr time work?</a></li><br>\r\n<li><a href=#27>The time specification on the \"Events\" page is confusing me. How does it work?</a></li><br>\r\n<li><a href=#28>Why are there orange and black dots on the location map?</a></li><br>\r\n<li><a href=#29>I don\'t understand how travelling (on land or on sea) works. The directions always seem to be wrong: If I say to move north, I end up moving east!</a></li><br>\r\n<li><a href=#30>How do I travel with someone on the road?</a></li><br>\r\n<li><a href=#31>My boat is stuck on land / I\'m not moving.</a></li><br>\r\n<li><a href=#32>My boat was suddenly warped to the middle of nowhere!</a></li><br>\r\n<li><a href=#33>My character is walking or driving on water! What gives?</a></li><br>\r\n<li><a href=#34>I can\'t get on a vehicle because there\'s a dead body inside, what can I do?</a></li><br>\r\n<li><a href=#35>Is it possible to kill someone with one hit?</a></li><br>\r\n<li><a href=#36>What happens when my character dies and what happens to his/her possessions?</a></li><br>\r\n<li><a href=#37>What if my character dies while on the road? Do my items disappear?</a></li><br>\r\n<li><a href=#38>How do you poke animals and slap people?</a></li><br>\r\n<li><a href=#39>Am I allowed to keep notes in real life?</a></li><br>\r\n<li><a href=#40>Can I use HTML in notes?</a></li><br>\r\n<li><a href=#41>I\'m trying to copy a note, but the copy I make is blank.</a></li><br><br></ol><br><br>\r\n<ol>\r\n<li><a name=1></a><b>Are there any matters of role-playing etiquette unique to Cantr that should be observed?</b><br>\r\n\r\nWhile everyone is encouraged to play in whatever style they find most comfortable, and while everyone no doubt thinks that their style is the best, there are several universal items of etiquette that all players should observe while playing.<br><br>\r\n\r\n1) Incessant knocking or note dropping are considered to be spamming. Methods to prevent this, such as gagging or binding, don\'t exist in Cantr, so we ask that players keep knocking and note dropping to the minimum necessary. Excessive knocking or \"note bombing\" with the intent to annoy other players will be dealt with by the Players Department.<br><br>\r\n\r\n2) Since recently created projects can only be canceled by the initiator, it\'s considered a minor exploit to sabotage machinery by adding small amounts of resources to large projects, or start projects in general that a character has no intention of completing. Projects like this will be cleared by the Players Department, and the player responsible will be contacted.<br><br>\r\n\r\n3) Slapping yourself to determine your character\'s strength and fighting skill is generally frowned upon as \"low class\", as it is an OOC thing to do. It may result in your character being ignored. If you need to know these attributes upon spawning, drag yourself instead, as it cannot be seen by other players because you won\'t succeed in dragging yourself without help.<br><br>\r\n\r\n4) * * Asterisks are the most universally used means of denoting an action (called <b>emoting</b>). Other methods can be used () - -, etc, but it will be easy for other players to identify the characters played by players who use alternative action symbols. However, the choice is yours.<br><br>\r\n\r\n5) When emoting, it must be something that the intended audience can witness with their senses. Thoughts, motivations, etc., should not be directly conveyed with emotes as there is no way for the audience to read a character\'s mind, although they can be indirectly conveyed through body language. For a good explanation of this, see <a href=http://forum.cantr.org/viewtopic.php?f=1&t=229&start=33>this forum thread</a>.<br><br>\r\n\r\n6) When emoting, you should also only include your own character\'s actions, not those of other characters as they should be able to decide themselves how to react.<br><br>\r\n\r\n7) When engaging in role-play that can be considered \"graphic\", please keep in mind that players of all ages and emotional dispositions play Cantr. The same action can be role-played in many different ways. If the player that you are roleplaying with expresses a desire for events to be toned down, please respect their wishes and dial it back to an acceptable impact level.</li><br><br>\r\n\r\n\r\n<li><a name=2></a><b>Is my character allowed to speak more than one language?</b><br>\r\nYour character is not allowed to speak, read, write in or understand any other language than the one you registered him or her with, unless (s)he encounters speakers of another language in the game and you actively roleplay a language learning process for a minimum of two years (40 days).</li><br><br>\r\n\r\n<li><a name=3></a><b>How do I make ... ?</b><br>\r\nYou can find the detailed requirements for anything that can be built in the game either in the build menu within the game or in the <a href=http://wiki.cantr.net/index.php/Main_Page>Cantr II Wiki</a>, though sometimes the Wiki may not be completely up to date.</li><br><br>\r\n\r\n\r\n<li><a name=4></a><b>How do I remember who someone is? After I name them, does everybody else see that name?</b><br>\r\nAfter clicking on the person (\"a man in his twenties\", \"a woman in her twenties\" etc.) on the \"Events\" page, a box will pop up where you can view the character\'s description and input a name for them. If you have JavaScript disabled, you will instead go to a character description page, where you can find a box for naming when scrolling down.<br>\r\nAlternatively you can open the \"People\" list of the location and then click on the smiley face next to the character you want to name. This will take you to their character description page, similar to if you had JavaScript disabled. The name can always be changed again. Others do not see what you give as their name or anyone\'s name, so feel free to call people what they really are (*winks*).</li><br><br>\r\n\r\n\r\n<li><a name=5></a><b>Why isn\'t anyone answering me?</b><br>\r\nRemember all characters are played by real players who can\'t be online all day, so it can take some time until someone can log in and answer you. There may also be different timezones involved.</li><br><br>\r\n\r\n\r\n<li><a name=6></a><b>How can I participate in a project?</b><br>\r\nWhen clicking on the \"Activity\" button, you will see a list of all projects in the location.<br>\r\nTo participate in one of them, you just have to click the \"P\" button. If the \"P\" button is not showing up, you\'re probably already working on another project. You have to stop working on it first before you can participate in another project. If you want to help another character with whatever project he is currently working on, you can click on the name of that character on the \"Events\" page and then on the \"P\" button to participate in the project, or you can open the \"People\" list and click on the \"P\" button next to the character whom you want to help.</li><br><br>\r\n\r\n\r\n<li><a name=7></a><b>How do I use a tool/an object/a resource on a project?</b><br>\r\nAs long as the necessary tool is in your inventory, it will be automatically used. You don\'t need to do anything else. This doesn\'t apply to resources and objects which are needed for the project, though. They need to be added to the project manually by clicking on the button with the symbol of a star near the respective material or object in your inventory.<br>\r\nAlternatively, when starting a project that needs resources or objects added, like manufacturing a tool or a shield, you can check a box to let the needed resources and objects be added automatically from your inventory. This box can be found under the question \"<i>Do you want the required resources and objects to be allocated automatically from your inventory?</i>\". It is recommended, though, to only use this box if you are really sure to have all the needed materials or are able to obtain them soon, because projects can\'t be cancelled anymore once resources or objects were added to them and you won\'t be able to get your already used resources or objects back. If the project uses a machine, the machine will also be blocked until the project is finished.</li><br><br>\r\n\r\n\r\n<li><a name=8></a><b>What happens to my project if I enter a building/vehicle while I\'m working?</b><br>\r\nYou will end participation on the project, and the project will remain in the location where it was started. You can resume working on it once you return, but (at least currently) projects cannot be moved between locations. In the past the button for entering wasn\'t visible while working on a project, but it was changed because it was confusing some people.</li><br><br>\r\n\r\n\r\n<li><a name=9></a><b>How many grams of ... does my character eat a day?</b><br>\r\nYou can find information about all existing foods in the <a href=http://wiki.cantr.net/index.php/Main_Page>Cantr II Wiki</a> by just searching for the name of the food you want to know something about. There you can find details about how much of a nourishing food you eat per day and how many grams of a healing food will heal 1%. There\'s also a complete <a href=http://wiki.cantr.net/index.php/Food>list</a> of all existing nourishing and healing foods.</li><br><br>\r\n\r\n\r\n<li><a name=10></a><b>My character has meat/corn/fish/apples/coconuts etc., but doesn\'t eat them each day! Why not?</b><br>\r\nSome foods like raw meat, fish and corn need to be prepared before they can be of any use. Also some foods like apples or coconuts aren\'t nourishing, but only for healing damage. These foods won\'t satiate your character, even if he is starving and carrying them in his inventory. To test if a certain food is a healing food, you can click on the \"eat\" button next to the food in your character\'s inventory. If it gives an error message, it isn\'t edible in any form. Otherwise it will tell you if it\'s a healing food, nourishing or energy restoring.<br>\r\nAlternatively, you can also just type the name of a certain resource into the <a href=http://wiki.cantr.net/index.php/Main_Page>Cantr II Wiki</a> to get the answer if it is a nourishing food, a healing food, both of these or none of these. There you also find information about the different ways in which a resource can be prepared as food or healing food.</li><br><br>\r\n\r\n\r\n<li><a name=11></a><b>My character has eaten a multiple of what he normally eats of the same food per day! Is this a bug?</b><br>\r\nMost likely this is not a bug, but a feature. ;) If you click on the smiley face next to your character\'s name (near the top on the screen) to open your character description and there is a sentence in the description of your character that he feels a bit faint, then it isn\'t a bug. By the way, the sentence indicating that a character is feeling faint can only be seen by that character\'s player, not by other players.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=12></a><b>What\'s a gram? How many grams can a character carry?</b><br>\r\nThe gram is the unit of mass in Cantr, but any resemblance to real life grams stops at the login screen because the weight of things in Cantr may differ greatly from real life weights. A character can carry up to 15000 grams.</li><br><br>\r\n\r\n\r\n<li><a name=13></a><b>I started a project to collect 100 grams of something, but now my character has more or less than 100 grams. Why?</b><br>\r\nWhen gathering resources, there is always a chance for a deviation of 20% in both directions.</li><br><br>\r\n\r\n\r\n<li><a name=14></a><b>It says my character is working on a project awkwardly/novicely/efficiently/skillfully/expertly. What does that mean?</b><br>\r\nThis refers to your character\'s skills. You can see them by clicking on the smiley face next to your character\'s name (near the top of the screen) and then scrolling down a bit to the headline \"Current Skills\". If a skill isn\'t listed here yet, that doesn\'t mean your character is bad in it, just that he hasn\'t tried it out yet, because only those skills get listed that your character has tried out at least once for a short moment. Your skill level doesn\'t influence the amount of resources you will get when gathering, only the time that is needed for a project. You can find a <a href=http://wiki.cantr.net/index.php/Skills>full list of all skills</a> in the Wiki.</li><br><br>\r\n\r\n\r\n<li><a name=15></a><b>Can I improve my character\'s skills?</b><br>\r\nYes, by working on projects that need the respective skill. The fighting skill increases when hitting characters whereas the size of the increase is directly proportional to the amount of force you use. Similarly, the hunting skill increases through hunting, and strength increases through fighting and hunting. To get from one skill level to the next may take a lot of time, though.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=16></a><b>I put some resources on the ground and now a part of them is gone although nobody picked some of them up. What happened?</b><br>\r\nMany resources like food or bones rot when they are left on the ground outside. Because of this, the amount of the resources will diminish once a day. To avoid the rotting, you have to either carry the resources in your inventory or put them into a container, building or vehicle. There they won\'t rot.</li><br><br>\r\n\r\n\r\n<li><a name=17></a><b>My character has a tool that should speed up the gathering of a resource, but it nevertheless says that he needs as long for the project as it would take a person without the tool. Why?</b><br>\r\nThe amount of time that is displayed in the project information is calculated for a completely average person without tools. If you have the right tools to speed up the gathering of a certain resource or if you are better than efficient in gathering this type of resource, the project will be finished faster than is displayed.</li><br><br>','','Ilona Ward <okarrdess@yahoo.com>','2013-11-10'),(1,1,'page_faq_2b','<li><a name=18></a><b>My project is at 100%, but still not finished. Why?</b><br>\r\nThis is a rounding issue, the project hasn\'t really reached 100% yet, the displayed pecentage has just been rounded up to 100%. Just wait until the next project tick, then your project will be finished.</li><br><br>\r\n\r\n\r\n<li><a name=19></a><b>Why can\'t I cancel a project?</b><br>\r\nProjects can only be canceled after enough time has passed since they were started. This is to prevent people from taking resources from other people\'s projects. Also you can\'t cancel old projects if someone is currently working on them. Your own projects you can cancel any time. There are only a few exceptions, for example reclaiming projects, since the type of keys and coins isn\'t recorded. If somebody with clearly malicious intents of sabotage is blocking machines with large projects on which he only used small amounts of resources, you may want to post about this on the <a href=http://forum.cantr.org/viewforum.php?f=4>Capital Rule Breaches Forum</a> or contact the support support@cantr.net.</li><br><br>\r\n\r\n\r\n<li><a name=20></a><b>Someone said \"OOC: (message)\". What does that mean?</b><br>\r\nThis means Out Of Character; it\'s the player, not the character, saying this. It is encouraged, though, that all OOC chatter remains OUT of the game because otherwise it ruins the role playing atmosphere for the other players. If it cannot be avoided completely, it should at least stay in whispers between the players. Notice, though, that whispers can be overheard by other characters in the location with a certain chance.</li><br><br>\r\n\r\n\r\n<li><a name=21></a><b>How can I whisper to somebody?</b><br>\r\nYou can whisper by clicking on a person\'s name in the events and then clicking on the button that looks like a speech bubble to talk to this person specifically, meaning whisper to that person. Alternatively you can open the \"People\" list and then click on the button with the speech bubble next to the character you want to whisper to. Normally, whispered messages are only heard by the two involved persons (the one whispering and the one whispered to), but there is a certain chance that other characters in the same location can overhear whispers. If you don\'t overhear a whisper of two other characters, it just looks like \"You see <i>PersonA</i> talking to <i>PersonB</i>\".</li><br><br>\r\n\r\n\r\n<li><a name=22></a><b>What is dragging? When my character drags someone, why does it seem to never progress at turn change?</b><br>\r\nDragging is to move things from one room to the other (also, dragging applies to the outside as well). Notes can be dragged instantly into a building, even if you do not have the key (imagine sliding the note under the door). When dragging a person, since they\'re heavy, you\'ll usually need help. Dragging isn\'t a project that would be listed on the \"Activity\" page, so if you want to help someone with dragging, you can\'t participate via the projects list, but have to click on the name of the person who is already dragging on the \"Events\" page. Then press the \"P\" button to assist in dragging. Alternatively, you can click on the \"People\" button and then on the \"P\" button next to the character you want to help with dragging.<br>\r\nDragging isn\'t a \"normal\" project in other respects, too. It won\'t progress over time like other projects, but will only be finished when enough people participate in it so that their combined strength is sufficient to drag whatever it is that should be dragged. You can see how much of the required strength the participants of the dragging already have by going back to your login screen with the character list and looking at the percentage next to the respective character.<br>\r\nWhen dragging persons, this percentage is dependent on the fighting skill and strength of the dragger in comparison to the dragged one. When not dragging persons, wheelbarrows can increase how much a character can drag (this does not apply to dragging characters).</li><br><br>\r\n\r\n\r\n<li><a name=23></a><b>The dragging is over 100%, but still isn\'t successful. Why?</b><br>\r\nThis may happen when two people are dragging from different locations (for example one from inside a car, the other one from outside). To make the dragging project succeed, the initiator of the dragging needs to stop participating in the dragging for a moment, then participate again and the dragging should be successful.</li><br><br>\r\n\r\n\r\n<li><a name=24></a><b>On the character selection screen, what do \"P\", \"D\" and \"T\" mean?</b><br>\r\nThese letters before the percentage of the progressed project are to represent their type.\r\n\"<b>P</b>\" simply means \"Project\", for example building or manufacturing something or collecting a resource.<br>\r\n\"<b>D</b>\" means \"Dragging\" and tells you that you\'re currently dragging something (more than likely a body or person) and the percentage tells you how much of the required strength you have.<br>\r\n\"<b>T</b>\" means that you\'re traveling, and the percentage is the progress you\'ve made to the next location.</li><br><br>\r\n\r\n\r\n<li><a name=25></a><b>How do these bars on the character description screen work? / How can I get rid of damage/tiredness/hunger?</b><br>\r\nAt the moment the only important bars are those for damage, tiredness and hunger.<br><br>\r\n\r\n<b>Damage:</b> The only way in which a character can get damage is by the attack of another character (or himself) or an animal, or by consuming certain poisons. Damage influences some features like fighting negatively and only heals very slowly, so it would be advisable to keep the bar at 0%. A faster way to get your damage bar back to 0 % is eating healing foods with the \"eat\" button in your inventory next to the healing food. Healing food must normally be eaten manually, the only time a character will eat a healing food automatically is if it\'s a dual action food (=also nourishing) and there are no single action nourishing foods that would be preferred. Which types of food are healing foods can be looked up in the <a href=http://wiki.cantr.net/index.php/Category:Healing_foods>list of healing foods</a> in the Wiki. If your damage bar reaches 100 %, your character will go in near death state. Carrying a shield in your inventory can prevent lots of damage, whereas shields made of better material can also prevent more damage. Information about all types of shields can also be found in the Wiki by clicking on a particular shield in <a href=http://wiki.cantr.net/index.php/Category:Protection>this list</a>.<br><br>\r\n\r\n<b>Tiredness:</b> Unlike in real life, Cantr characters don\'t have to sleep every day. The tiredness bar raises slightly when working on projects and hunting, but as it decreases automatically at a higher rate than working on projects or hunting make it rise, there is no need to do anything about it. However, if your character drags and especially if he attacks other characters (or himself), the tiredness bar raises rapidly. As tiredness influences your character\'s fighting capabilities and other things negatively, it could be wise to speed up the decrease of the tiredness by resting on special kinds of furniture like benches, rugs or beds (for a full list of resting furniture consult <a href=http://wiki.cantr.net/index.php/Category:Resting_furniture>this list</a> in the Wiki) or by drinking revitalizing things like tea. To rest on such furniture, you have to click on the button with the symbol of a bed next to the furniture.<br><br>\r\n\r\n<b>Hunger:</b> Cantr characters need to eat every day and do so automatically at a fixed time each day if they have any kind of nourishing food in their inventory. You can also eat in advance using the eat button, in which case the food will go in the stomach and gets digested at the eating tick. If your character doesn\'t have any nourishing food in his stomach or inventory at the eating time, the hunger bar will raise 5% each day and you will get the message that your character is hungry. As soon as your character has nourishing food again, the hunger bar will decrease 4% each day that your character eats normally. When the hunger bar reaches 100 %, your character will die, but there probably will be a delay of several Cantr minutes between reaching 100 % and dying. If the bar has reached 100 %, you can only save your character by eating manually, because they will die before the next eating tick.</li><br><br>\r\n\r\n\r\n<li><a name=26></a><b>How long is one Cantr day/year? How does Cantr time work?</b><br>\r\nOne Cantr day is just as long as a real life day, but consists only of 8 hours (turns/ticks). Therefore, 1 Cantr hour equals 3 real life hours.<br><br>\r\n\r\n1 Cantr year = 20 Cantr days = 20 real life days<br>\r\n1 Cantr day = 8 Cantr hours = 1 real life day<br>\r\n1 Cantr hour = 36 Cantr minutes = 3 real life hours<br>\r\n1 Cantr minute = 60 Cantr seconds = 5 real life minutes<br>\r\n1 Cantr second = 5 real life seconds<br>\r\n[10 Cantr years = 200 real life days]<br>\r\n[100 Cantr years = 2000 real life days, thus about 5 and a half real life years]</li><br><br>\r\n\r\n\r\n<li><a name=27></a><b>The time specification in the events is confusing me. How does it work?</b><br>\r\nIn the events the time is displayed in the following format: day-hour.minute\r\nSo if, for example, the time of an event is 2864-2.29, this means it is day 2864, hour 2, minute 29 (in Cantr time of course). Seconds aren\'t displayed in the events, even though you can always see the current second of the Cantr time on top of the screen.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=28></a><b>Why are there orange and black dots on the location map?</b><br>\r\nThe orange dot is you, always in the center of the map and at your momentary location. Big black dots are cities and small black dots are boats in the water (or on shore).</li><br><br>\r\n\r\n\r\n<li><a name=29></a><b>I don\'t understand how travelling (on land or on sea) works. The directions always seem to be wrong: If I say to move north, I end up moving east!</b><br>\r\nThe most important thing to know about travelling is that on the Cantr location map the top is not pointing north, even if we are used to this in real life. North is actually to the RIGHT of the map (i.e.: The map is rotated 90 degrees clockwise). Because of this, east is really down, south is really left and west is really up. When travelling by foot, entering the command for a boat to move or reading maps, remember this and everything should make sense. When clicking on the \"Location\" button and looking at the map there, you can also see the directions next to the picture.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=30></a><b>How do I travel with someone on the road?</b><br>\r\nCurrently, this isn\'t entirely possible, but can be done with creative means. If both you and the other person have the same amount, or close to, of weight, and you both leave at the same time, you will more than likely travel together on the road. But not always does this happen. If one of you leaves before the other or if one carries more than the other, one might eventually get so far ahead that communication will be impossible.<br>\r\nClicking on the person\'s smiley face in the \"People\" list, you can see at the end of their description how fast they are walking in relation to you, where they are in relation to you and what direction they are going. Clicking on the equal sign next to the person in the \"People\" list, your character\'s speed will automatically be adjusted to that of the other person. Of course it\'s the fastest person of a travelling party who needs to do this as he can slow down, but the slower ones cannot go any faster. If any of the involved characters is using a vehicle, the button for the automatic speed adjustment won\'t work and the speed needs to be adjusted manually with the >> button. You can always check if the manual adjustment was correct by clicking on the smiley face next to the other character again. If it says at the end of their description that they are travelling at your speed, it worked, if they are still slower you need to slow down more.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=31></a><b>My boat is stuck on land / I\'m not moving.</b><br>\r\nThere is always a chance that your boat gets stuck on the land when undocking, or even while traveling, and it can be a nuisance to get out. Some tips to remember: aim your boat\'s direction toward the quickest way to the water. When in the land, never say to take \"0\" turns (since with 0 turns, the boat will keep moving until it hits land. Guess what? You\'re ON land! You won\'t move.), but try 4 turns (half a day).\r\nIf you\'re in water and you\'re not moving, perhaps you\'ve completed how many turns you specified to move, or you\'ve hit a small piece of land that sticks out and is barely noticable. Try changing your direction or increasing the number of movement turns.</li><br><br>\r\n\r\n\r\n<li><a name=32></a><b>My boat was suddenly warped to the middle of nowhere!</b><br>\r\nPost in the <a href=http://forum.cantr.org/viewforum.php?f=3>General Support Forum</a> or contact support by email to support@cantr.net. A staff member will send your ship back to where it came from.</li><br><br>\r\n\r\n\r\n<li><a name=33></a><b>I can\'t get on a vehicle because there\'s a dead body inside, what can I do?</b><br>\r\nContact the support using the <a href=http://forum.cantr.org/viewforum.php?f=3>General Support Forum</a> or via email to support@cantr.net, and the body can be removed.</li><br><br>\r\n\r\n\r\n<li><a name=34></a><b>My character is walking or driving on water! What gives?</b><br>\r\nAll paths between locations are linear, meaning they are straight lines. There may be some paths that go from one place to the other and lead over water in between, so your character will walk over it. Don\'t worry, you can\'t drown... yet...</li><br><br>\r\n\r\n\r\n<li><a name=35></a><b>Is it possible to kill someone with one hit?</b><br>\r\nYes and no. It is only possible if the person who gets hit already has lots of damage. It is not possible, with any weapon, if they have full health (even without protection). Notice that you can hit a character only once a day.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=36></a><b>What happens when my character dies and what happens to his/her possessions?</b><br>\r\nWhen your character has died, you won\'t be able to access the events for this character anymore, but you will receive an e-mail with the last events for this character. If you don\'t receive this e-mail, look into your junk-mail folder to make sure the e-mail didn\'t end up there. If the e-mail isn\'t there either, you may want to contact the support support@cantr.net about this or post on the <a href=http://forum.cantr.org/viewforum.php?f=3>General Support Forum</a>.<br>\r\nWhen your character dies, everything that he/she was carrying - your notes, food etc. - will drop to the ground. This means anyone there can take them. Only the clothes your character was wearing (not carrying in his inventory, but really wearing) won\'t drop to the ground, but remain on his body. They can still be removed, however, until somebody starts to bury your character.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=37></a><b>What if my character dies while on the road? Do my items disappear?</b><br>\r\nYour possessions and your character\'s body will appear on the ground in the location to your rear.</li><br><br>\r\n\r\n\r\n<li><a name=38></a><b>How do you poke animals and slap people?</b><br>\r\nBy hitting with the bare fist and 0% force.</li><br><br>\r\n\r\n\r\n\r\n<li><a name=39></a><b>Am I allowed to keep/take character notes outside of Cantr (like on my computer desktop)?</b><br>\r\nJust like a real person, your character should be thought of as having the brain functions of memory and intelligence. Notes that are taken to aid your character\'s memory should be kept in the game, since this is purely in-character. However, some players use documents that aid in their character\'s intelligence. For example, players of savvy merchants may keep complicated excel spreadsheets to aid them in fair pricing. Obviously, these can\'t be imported into the game, and it is just assumed that the character is either very intelligent or figures it out by other laborious means in-character. Copying memory notes for personal OOC use is of course ethical. However, the Capital Rule must be observed at all times when dealing with in-character notes OOC, and the distribution of maps to other parties is strictly forbidden.</li><br><br>\r\n\r\n\r\n<li><a name=40></a><b>Can I use HTML in notes?</b><br>\r\nYes, you can. But make sure you close all your HTML tags, or it may mess up the note completely. It\'s also no longer possible (as of May 25th, 2004) to put HTML in the note title, but all existing notes with HTML in the title will still have the tags existing, although editing these notes causes them to lose the HTML in their title.</li><br><br>\r\n\r\n<li><a name=41></a><b>I\'m trying to copy a note, but the copy I make is blank.</b><br>\r\n\r\nChange the encoding of the note you want to copy to UTF-8. You can do this by clicking the encoding link on the upper right of the screen while viewing the note.</li></ol><br><br>','','Ilona Ward <okarrdess@yahoo.com>','2013-11-10'),(1,1,'page_faq_3','<b>Non-game-related questions </b> (Last update: \r\n        March 4th, 2010)<br>\r\n        <br>\r\n        <ol>\r\n          <li><a href=#1>How do I log into the IRC?</a></li>\r\n            <br>\r\n          <li><a href=#2>What are the commands I can use on the IRC?</a></li>\r\n            <br>\r\n          <li><a href=#3>How do I set up mIRC to connect to the Cantr OOC Discussion \r\n            Channel?</a> </li>\r\n            <br>\r\n          <li><a href=#4>I have a question I\'d like added to this FAQ!</a></li>\r\n        </ol>\r\n        <br>\r\n        <ol>\r\n          <li><a name=1></a><b>How do I log into the IRC?</b><br>\r\n            You can log in using any IRC client, including (but not limited to) \r\n            mIRC (<a href=http://www.mirc.com>www.mirc.com</a>), Trillian (<a href=http://www.trillian.cc>www.trillian.cc</a>), \r\n            and Mibbit Web Client (<a href=\"<CANTR REPLACE NAME=link_irc>\">here</a>).\r\n            <br>\r\n            No matter which you use, you must connect to the Gnug at irc.gnug.org. Make sure to connect to port 6667.<br>\r\n            <br>\r\n            Once on the IRC, you will need to join #Cantr by typing: /join #Cantr \r\n            <br>\r\n            If using Cantr\'s Java Client, you\'ll automatically connect to the previous official Cantr IRC channel on DALnet. <br>\r\n            <br>\r\n            This FAQ will not cover extensive help on troubleshooting or setting \r\n            up your IRC client.<br>\r\n            <br>\r\n            <br>\r\n          </li>\r\n          <li><a name=2></a><b>What are the commands I can use on the IRC?</b><br>\r\n            /join #[chat] - This command will send you to a specific room. \r\n            <br>\r\n            Eg: /join #Cantr <br>\r\n            <br>\r\n            /nick [name] - This command will change your nickname. <br>\r\n            Eg: /nick Anthony <br>\r\n            <br>\r\n            /nickserv register [password] [e-mail] - This command \r\n            will register your nickname to disallow others from using it. Do this \r\n            only if you plan on coming to the IRC often, to use the same name. \r\n            You will be required to use a proper e-mail address to confirm the \r\n            registration. <br>\r\n            Eg: /nickserv register 123456 abc@bca.com <br>\r\n            <br>\r\n            /nickserv identify [password] - After logging in, and changing \r\n            your nickname to your registered name, you\'ll need to identify \r\n            yourself with Nickserv to prove that you are the owner of the Nickname. \r\n            <br>\r\n            Eg: /nickserv identify 123456 <br>\r\n            <br>\r\n            /me [emote] - This command will create an action. <br>\r\n            Eg: /me gives Anthony a hug. <br>\r\n            Will result in: Anthony gives Anthony a hug. <br>\r\n            <br>\r\n            /msg [nickname] [message] - This command will allow you \r\n            to private message an online user. (Depending on the client, you can \r\n            also double click on the username to open a new window for the private \r\n            message) <br>\r\n            Eg: /msg Anthony You\'re so damn cool! <br>\r\n            <br>\r\n            <br>\r\n          </li>\r\n          <li><a name=3></a><b>How do I set up mIRC to connect to the Cantr \r\n            OOC Discussion Channel?</b><br>\r\n            - Allow me to run through a quick tutorial. <br>\r\n            1) Click \"Tools\", then \"Options\", then choose the \r\n            \"Connect\" category. <br>\r\n            2) Fill in the required information. (Full Name, e-mail, Nickname, \r\n            and Alternate) <br>\r\n            a. Full Name & e-mail: Self-explanatory <br>\r\n            b. Nickname: This will be the name you\'ll log in as once you\'re \r\n            connected to IRC. You can change this on the IRC server with the /nick \r\n            command. <br>\r\n            c. Alternate: In case your nickname is taken, you\'ll change to \r\n            this one automatically. <br>\r\n            3) Next, choose \"Servers\" after opening (Clicking \"+\") \r\n            the \"Connect\" category. <br>\r\n            4) The Gnug server is probably not in the list of networks, so you have to add it yourself. In order to do that, click on \"Add\", enter whatever you like as description, enter irc.gnug.org as IRC server and leave the port at 6667. Don\'t enter anything in \"Group\" or \"Password\". Click on \"Add\". <br>\r\n            5) Next, choose \"Options\" within the \"Connect\" \r\n            category. <br>\r\n            6) Click the \"Perform...\" button. <br>\r\n            7) Check \"Enable Perform\" and make sure \"All Networks\" \r\n            is selected. <br>\r\n            8) Type in the box: (If your nickname isn\'t registered, only type \r\n            the second line) <br>\r\n            /nickserv identify [password] [Press Enter] <br>\r\n            /join #Cantr <br>\r\n            9) Click Ok, then Ok again to get out of the \"Options\" menu.<br>\r\n            10) TaaDaa! All done! Now, whenever you press the connect button, \r\n            you\'ll automatically connect to the DALnet server, identify your \r\n            registered nickname, and join the #Cantr channel. <br>\r\n            <br>\r\n            <br>\r\n          </li>\r\n          <li><a name=4></a><b>I have a question I\'d like added to this FAQ!</b><br>\r\n            - Please, send them in! There is a forum post in the <a href=http://forum.cantr.org/viewforum.php?f=3>General \r\n            Support forum</a> (near the top, it\'s a Sticky) where you can post \r\n            the questions you\'d like answered in the next version of the FAQ.<br>\r\n            <br>\r\n            <br>\r\n            <br>\r\n            <br>\r\n          </li>\r\n        </ol>','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-09-09'),(1,1,'page_forgotten_password','Forgot your password?','','Wiktor Obr?bski <psychowico@gmail.com>','2012-05-08'),(1,1,'page_fuel_level','Fuel Level:','','Chris Johnson <cj.cantr@gmail.com>','2007-01-17'),(1,1,'page_going_to_destroy_building','You are going to start destruction of','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-10-18'),(1,1,'page_hurt_weapon','With this form you can select the weapon you want to use and the amount of force you want to apply.<br />\r\nNote: Using 0 % and a bare fist will result in a slap in the face.<br />','','Ilona Hyvttinen <okarrdess@yahoo.com>','2011-08-05'),(1,1,'page_improve_1','To improve this #TYPE# to a #NEXT# you will need #SAND# grams of sand, #STONE# grams of stone and #OIL# grams of oil. The project will take #DAYS# days. Click on the next button if you want to continue starting this project or on the back button below if you do not.\r\n',NULL,'Jos Elkink <jos@cantr.net>','2003-05-20'),(1,1,'page_irc_go_to_irc','Java IRC client was removed. Please follow the link below to access mibbit irc client.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-09-29'),(1,1,'page_links_1','Below you can find links that might be interesting for players of Cantr II.',NULL,'Jos Elkink <jos@cantr.net>','2003-12-04'),(1,1,'page_location_building_description','Building description','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-07-11'),(1,1,'page_location_capacity_used','Weight capacity used:','','Chris Johnson <cj.cantr@gmail.com>','2007-01-17'),(1,1,'page_location_description','Description','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-01-02'),(1,1,'page_location_people_capacity_used','Person capacity used:','','Chris Johnson <cj.cantr@gmail.com>','2007-01-17'),(1,1,'page_location_subcategory_description','Description','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-01-02'),(1,1,'page_location_subcategory_domestication','Domestication','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-01-02'),(1,1,'page_location_subcategory_hunting','Hunting','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-01-02'),(1,1,'page_login_1','Please do not bookmark this page. Bookmark https://www.cantr.net/ instead. Thank you!','','Ilona Hyvttinen <okarrdess@yahoo.com>','2008-04-01'),(1,1,'page_login_backtostart','Back to the start page','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-08-21'),(1,1,'page_mail_all_1','Enter the message to be sent to all players below. There are no automatic parts to the message, so please do not forget to add your name and staff position. The reply-to address will be the Players Department.',NULL,'Jos Elkink <jos@cantr.net>','2003-04-12'),(1,1,'page_manage_advert_new','Create a new advertisement entry',NULL,'Jos Elkink <jos@cantr.net>','2003-03-06'),(1,1,'page_manage_animals_1','Give the name of this animal. This name has to be unique. Use only small characters, no capitals. The name will not be visible to the user.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_10','Give the strength of this animal at full health.',NULL,'Cosmo Harrigan <cosmo@cantr.net>','2003-03-21'),(1,1,'page_manage_animals_11','Give the strength of this animal\'s natural armour.',NULL,'Cosmo Harrigan <cosmo@cantr.net>','2003-03-21'),(1,1,'page_manage_animals_12','List the raw materials that the animal will leave behind when killed.',NULL,'Cosmo Harrigan <cosmo@cantr.net>','2003-03-21'),(1,1,'page_manage_animals_13','Enter the number of days an animal of this type will live for. The actual lifespan will be within 10% of this figure. 20 days or less is low, 100 or more is high ','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-04'),(1,1,'page_manage_animals_14','Enter total maximum population. Once the number of animals of this type reaches this number they will stop breeding','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-04'),(1,1,'page_manage_animals_15','Enter maximum number allowed in a location. Local populations above this will face overcrowding effects.','','Chris Johnson <cj.cantr@gmail.com>','2007-07-09'),(1,1,'page_manage_animals_2','Give the types of travelling this animal can do. You can select multiple options at once.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_3','Give the percent chance that this animal will start travelling, each day.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_4','Give the chance per day that this character reproduces, when on the same location with a mate.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_5','Select the types of area this animal can be found. Multiple areatypes can be selected.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_6','Give the percent chance that this animal will attack people, on an average day.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_7','Give the force of such an attack - the percentage strength a victim looses on average per attack.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_8','Give the type of animal this character can mate with.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_9','The speed per day. Human walking is around 10 max.',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manage_animals_new','Create a new animal type',NULL,'Jos Elkink <jos@cantr.net>','2003-03-10'),(1,1,'page_manufacture_clothes_1','You can select a clothes item to manufacture below.',NULL,'Jochem van Leeuwen <jochem@webfaqs.net>','2004-07-05'),(1,1,'page_newbie_guide_1','<P>Welcome to Cantr II.  Before creating your account, please read the following text carefully. Cantr II is unlike most other online games.\r\n\r\n<P>The fundamental idea is to simulate the development of societies.\r\n\r\n<P>Each character you create will awaken in a unique environment, created entirely by other players. There are no pre-determined goals, and no backstory. Roleplay is immersive. Societies may develop very differently in different regions.\r\n\r\n<P>The Cantr world is somewhat realistic, though technology levels are unusual. There are few limitations for character development.\r\n\r\n<P>Since all characters are played by real people, Cantr can be a very slow-paced game.\r\n\r\n<P>Though fighting is possible in Cantr, it is limited. Character death is permanent.\r\n\r\n<P>PLEASE NOTE: If your idea of a good time is to leave a trail of corpses behind you, Cantr II is not the game for you.\r\n\r\n<P>The game world is ongoing. There are no levels, quests, or Out of Character achievements for you as a player. Its not a game to win. Your characters take part in and contribute to a living history.\r\n\r\n<P>There is no magic in Cantr, and it is not a fantasy environment. You may however create characters who have strange beliefs, though others might consider them insane.\r\n\r\n<P>Most importantly, there is one rule that governs all interactions among the characters in Cantr II:\r\n<CENTER><B>The Capital Rule</B></CENTER>\r\n\r\n<P>You must play each character exclusively from their own environment and experiences in game. That is, you may not use any Out of Character (OOC) knowledge that you as a player have obtained from your other characters or from fellow players to gain advantage over others.\r\n\r\n<LI>While each player is allowed to create up to 15 characters, these characters MUST be separate and unique individuals. You may not share knowledge or goals among your characters, and their actions may not benefit each other in any way. Your characters may never be part of the same family, organisation, or group.\r\n\r\n<LI>Cantr is a multilingual game, and you may create characters in any language group for which you have conversational ability. However, each character in game knows only one language to spawn with, even if you as a player can understand other languages Out-Of-Character. When your characters encounter other languages spoken in the game, they may learn through roleplay and available in-game resources. This is intended to create a more fair environment for monolingual players and language learners.\r\n\r\n<P>Information about the world of Cantr II and the things within it as history or maps are not available in any \'Cantr Official Website II\' or any other means of information, and should only be collected and shared within the game and between characters.\r\n\r\n<P>For more information, please read the Cantr Wiki <a href=\"http://wiki.cantr.net/index.php/Game_Rules\">Game Rules</a>, and join our out-of-character <a href=\"http://forum.cantr.org\">Discussion Forums</a>, or visit the Cantr irc chans.\r\n\r\n<P><font color=cyan>Players are allowed only one single account. New accounts must be registered from a real and transparent IP address. If you need help with this, please contact Support using the <a href=\"index.php?page=contact\">support form</a>. Also, returning players may contact Support to revive past accounts.</font>\r\n\r\n<P>Cantr II is open to players of all ages. While explicit roleplay is not disallowed, you MUST secure OOC consent with other adult players prior to any in game events.\r\n\r\n<P>All gameplay is monitored by the Players\' Department. If you have questions at any time regarding the Capital Rule, or allowable gameplay options, please contact the Players\' Department.\r\n<P>Enjoy the game!','','Pilot  <pilot.cantr@gmail.com>','2016-08-14'),(1,1,'page_newbie_guide_2','I agree to follow the rules of Cantr','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-03-24'),(1,1,'page_newbie_guide_3','I also understand that only one account per player is allowed.<p>Note that if using the same Internet connection as other players, you may be suspected of attempting to create than one account, but you may always contact staff to avoid or clarify suspicion.</p><p><font color= yellow>If you are a returning player and would like your old account reactivated, simply request it, along with information we can use to find it, in your application.</font>','','Joshua Mathias <Joshuamonkey@gmail.com>','2016-07-26'),(1,1,'page_pd_rights_responsibilities','Players Department is responsible for guiding players, investigating suspected rule breaches (especially Capital Rule) and imposing sanctions.<br>\r\nSanction on player for breaking the rules or causing disruption for other players (by spam or unjustified use of OOC communication) is based on the significance of the breach, its impact on the game, player\'s case history, prior decisions in similar cases and player\'s will to cooperate.<br>\r\n<br>\r\n<b>Player</b> is obliged to:\r\n<ul>\r\n<li>give all the information regarding the characters taking part in the suspected breach</li>\r\n<li>implement character actions affecting the game world commanded by PD</li>\r\n<li>keep privacy and anonymity of the conversation regarding PD member and other affected players</li>\r\n</ul>\r\n\r\n<b>Player</b> has right to:\r\n<ul>\r\n<li>be handled with respect</li>\r\n<li>ask for exact recommendations what each character should do to resolve the case</li>\r\n<li>request supervision of PD chair over the case</li>\r\n<li>request investigation by Game Administration Board if suspects that PD is handling case incorrectly or unfairly</li>\r\n</ul>\r\n','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-12-24'),(1,1,'page_player_1','Cantr II is a very anonymous game. Nobody can see who is playing what character. You can however join an <i>out-of-character</i> group to chat about the game - or of course about anything - with other players. Please make sure that you know and understand the <B>Capital Rule: you cannot use knowledge that you gather out-of-character when you are playing your characters.</B> Anyway, please join.<BR><BR>\r\n\r\nThe forum for out-of-character discussion can be found <A HREF=http://forum.cantr.org TARGET=_blank>here</A>.\r\n\r\nJoining this group is <B>strongly encouraged</B>, as the game administrators use it as the main forum to discuss new ideas, to find assistance, or to explain <A HREF=http://wiki.cantr.net/index.php/Game_Rules TARGET=_blank>rules</A> that are not clear.','','Pilot  <pilot.cantr@gmail.com>','2017-05-21'),(1,1,'page_player_2','Another way of chatting about the game out-of-character is going to the Cantr IRC channel. This channel can be found on IRC server chat.rpgworlds.com, and the name of the channel is #Cantr. If you are new to IRC, you can go to this <A HREF=http://www.irchelp.org/irchelp/irctutorial.html TARGET=new>online tutorial</A> to get to know the basics. That site will also contain links where you can download IRC software.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-01-31'),(1,1,'page_player_3','Although Cantr is only run by volunteers and freely available, running a game like this does cost some money. We have to pay on a monthly basis for our server and in we have some small additional costs. The more money we have, the better quality of service we can deliver. Therefore, we would like to encourage everybody to donate to Cantr using one of the following voluntary monthly subscriptions. Note, however, that people that donate do not get any additional privileges in the game. Thanks in advance for your support!',NULL,'Jos Elkink <jelkink@gmail.com>','2004-11-03'),(1,1,'page_player_4','You can use Yahoo! PayDirect as well. You\'ll need a Yahoo! Account to use it.','','Sabrina Hartmann <sabsi_h@gmx.net>','2010-02-09'),(1,1,'page_player_5','We also encourage you to join Cantr\'s <a href=\"https://discordapp.com/invite/rpquAWT\" target=\"_blank\">Discord chat server</a>! You can also connect through IRC by going to channel #Cantr on the irc.newnet.net IRC server, or using this link: ','','Joshua Mathias <Joshuamonkey@gmail.com>','2017-05-20'),(1,1,'page_player_6','Instead of a subscription, you can also decide to donate to Cantr II just for once using the button below. You can set the amount to anything  you want.',NULL,'Jos Elkink <jelkink@gmail.com>','2004-11-03'),(1,1,'page_projects_search','Above you can enter a search term to search the projects on this location. You can only search for keywords in the name of the project, excluding the names of characters. If you leave the search field empty, you get a list of all projects on this location.\r\n<p>You can choose how the results of the search will be ordered, by selecting the alternative of your choice to the right.','','Fredrik Bekken <fredrik@cantr.org>','2010-05-20'),(1,1,'page_projects_search_active','Search only in active projects','','Jos Elkink <jos@cantr.net>','2005-08-23'),(1,1,'page_project_amount','Amount to be used','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-01-21'),(1,1,'page_project_info_not_here','is not here anymore',NULL,'Jos Elkink <jos@cantr.net>','2003-05-27'),(1,1,'page_project_resource_name','Resource name','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-01-21'),(1,1,'page_repair_1','Fully repairing this item would take an average person #HOURS# hours. ',NULL,'Jur Schagen <jurschagen@hotmail.com>','2005-02-07'),(1,1,'page_repair_2','How much time do you want to spend?',NULL,'Jur Schagen <jurschagen@hotmail.com>','2005-02-07'),(1,1,'page_retrieve_1','Select the amount you want to take out. The maximum is #MAX# grams.',NULL,'Jos Elkink <jos@cantr.net>','2003-11-20'),(1,1,'page_retrieve_2','Select the raw material you want to take out of this storage.',NULL,'Jos Elkink <jos@cantr.net>','2003-11-20'),(1,1,'page_retrieve_cant_manipulate_no_key','You can see but you cannot manipulate contents of this storage, because you don\'t have a key.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-01-17'),(1,1,'page_retrieve_cant_manipulate_sealed','You can see but you cannot manipulate contents of this storage, because it is sealed.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-07-15'),(1,1,'page_retrieve_destination_ground','Ground','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-01-21'),(1,1,'page_retrieve_destination_ingest','Ingest','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-06-24'),(1,1,'page_retrieve_destination_inventory','Inventory','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-01-21'),(1,1,'page_retrieve_looking_into','Looking into:','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-01-17'),(1,1,'page_retrieve_multi','Retrieve more objects then','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-06-15'),(1,1,'page_retrieve_select_destination','Select destination','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-01-21'),(1,1,'page_rules_capital_rule','The most important rule in the game is very short:\r\n<h2>The game must be played exclusively from the perspective of each individual character</h2>\r\n<br>\r\nImplications:\r\n<ul>\r\n<li>Our own Out Of Character (OOC) knowledge may not be used to give your character an advantage over the characters of other players.</li>\r\n<li>You may use only the knowledge each character obtains on their own within the game. For example, if one of your characters witnesses an event, your other characters must act as if they have no knowledge of it until they learn for themselves independently in the game environment.</li>\r\n<li>While each player is allowed to create multiple characters, those characters MUST be separate and distinct individuals. You may NEVER use multiple characters together to help each other. Character death is permanent, and reincarnation or other transfer of knowledge or possessions from one to another is not allowed.</li>\r\n<li>You may not have multiple characters as part of the same family, clan, army, company, etc.. They may not share resources, and they cannot join in any activity which profits one another, even from different locations. They must have their own individual interests and goals, and these must not intersect.</li>\r\n<li>If you cannot avoid having two of your characters meet, it is best that one \'sleeps\'. If interaction is unavoidable, you must carefully play as if they were played by strangers. But keep in mind, that since you as a player are controlling when your characters are awake and what they know, there are some intrinsic advantages to their interaction that no kind of roleplay can mitigate and which are unfair to other players. Capital Rule is more important than consistence of role-play and it can never be used as an excuse.</li>\r\nSome exceptions are occasionally made in new and developing regions to allow players to have multiple characters living together. <li>However, its never allowed to use more than one of your characters to drag or attack another character. The Players Department monitors gameplay in such cases, so if you believe your characters will be involved in exceptional circumstances, you should seek guidance from the PD beforehand.</li>\r\n<li>You are allowed only one account, with no more than 15 characters. If you share a computer with another player, you must notify the Players Department. Only one player may access each account.</li>\r\n<li>You may not plan or coordinate any in game events with other players OOC, even when to log in. It is not allowed to share maps, resource locations, or any other specific in game information with other players OOC.</li>\r\n<li>Your characters should not have a background story describing the time before they spawned. They can have predetermined personalities or traits, and you can even have them act as if they have a back story, but this should not be made public to the other characters.</li>\r\n</ul>','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-12-21'),(1,1,'page_rules_introduction','The following page contains all the rules regarding the actions happening in the game...','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-12-24'),(1,1,'page_rules_ncs','<h3>Cantr II is open to players of all ages. Before engaging in any explicit sexual or excessively violent roleplay, you must first secure OOC consent from an adult player. It also applies for all observers.</h3>\r\nThe Non-Consensual Sex Rule (NCS) entails that since minor players are considered incapable of providing consent, you must make every effort to ensure that explicit roleplay is not witnessed by them.<br>\r\nThus, you should avoid potentially offensive language in whispers which might be overheard in a crowd of characters of unknown players. You are allowed to for confirmation of player age from PD in private, but it is your responsibility to obtain consent.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-12-21'),(1,1,'page_rules_one_language','It\'s an implication of Capital Rule.<br>\r\n<h3 class=\"centered\">Each character spawns knowing only one language, no matter how many you as a player know.</h3>\r\nYour characters may travel or meet characters from other language zones and learn new languages in game. But, even if you as a player have knowledge of a second language OOC, you must roleplay for each character a language-learning process for a minimum of forty (40) days.<br>\r\nThis Language Rule is to mitigate any advantage for multilingual players. You are allowed during this process to describe the actions of your character using any common language, though your character may only speak words learned in game.<br>\r\nIt\'s understood that characters will learn grammar from experience, but some attempt should be made to explore it. Machine translation such as google may aid in the language-learning process, but it is never a substitute for real world knowledge. You are not allowed to spawn a character in a language in which you have no working knowledge. Characters who use machine-generated language are only disruptive to native speakers and thus not allowed.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-12-21'),(1,1,'page_searchtagnames','Search in names:','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-09-22'),(1,1,'page_searchtranslations','Search a translation by its content',NULL,'Judith Meyer <junesun@gmx.net>','2005-08-20'),(1,1,'page_select_amount_project','In #DAYS# day(s) you can produce #GRAMS# grams of #TYPE#. You will need the following raw materials:','','Fredrik B. <fredrik@cantr.org>','2011-10-29'),(1,1,'page_signs_add_new','Add new sign','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_change_sign','Change sign text ','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_existing_project_exists','SIGN ALTERATION PROJECT','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_have_correct_tools','You are carrying tools suitable for altering signs.','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_have_no_correct_tools','You are not carrying any tools suitable for altering signs.','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_in_position','in position','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_move_sign','Move sign','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_new_text','New text:','','Jos Elkink <jos@cantr.net>','2007-01-10'),(1,1,'page_signs_not_alterable_here','These signs can only be altered on the outside of the location','','Chris Johnson <cj.cantr@gmail.com>','2007-02-21'),(1,1,'page_signs_project_instructions','To set up a sign alteration project select the type of project from the list on the left and fill in the required details on that row.\r\nSigns in position 1 will be used as the default name for the building or vehicle. Signs in other positions are visible on the buildings page. ','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_remove_sign','Remove sign','','Chris Johnson <cj.cantr@gmail.com>','2007-01-02'),(1,1,'page_signs_setup_sign_project','SETUP SIGN PROJECT','','Chris Joh