Hi #NAME#,\r\n\r\nYour account for Cantr II has been accepted!\r\nYour username is: #USERNAME# (you also can login with your ID number: #ID#)\r\nTo start to play with us, you have to login on <a href=\"#LOGINPAGEURL#\">intro server by clicking here</a> and insert your password to join the game.\r\nIf you have any questions, please send an email to support@cantr.net.\r\n\r\nPlease note that if you do not login within a week, your account will be deactivated.\r\n\r\nYours,\r\n#ADMIN#\r\n','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-07-30'),(1,1,'player_account_accepted_message','Hi #NAME#,\r\n\r\nYour account for Cantr II has been accepted!\r\nYour username is: #USERNAME# (<i>you also can login with your ID number: #ID#</i>)\r\nTo start to play with us, you can identify yourself <a href=\"#LOGINPAGEURL#\">here</a>\r\n\r\nIf you have any questions, please send an email to support@cantr.net.\r\n\r\nPlease note that if you do not login within a week other than on the day that you subscribed, your account will be canceled again. After that you will have to login at least every two weeks to keep your account active, unless you explicitly set it to be \"on leave\". \r\n\r\nYours,\r\n#ADMIN#\r\n\r\n(This is an automatically created message.)','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-07-30'),(1,1,'player_account_accepted_subject','Cantr II account accepted',NULL,'Jos Elkink <jos@cantr.net>','2005-06-10'),(1,1,'player_intro_account_pending','Your application is being reviewed by the Players Department. In the mean time, you may familiarize yourself with the game interface. Also, please start using your test character.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-01'),(1,1,'player_intro_account_refused_text','Your account application has been refused for some reason. Please check your mailbox to read the reason and apply again.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'player_intro_confirm_enter_accept','Onward to the main w