aping to avoid identification without role-playing a dyeing process, etc.)</li>\r\n</ul>\r\n<h3>Grey areas:</h3>\r\n<ul>\r\n<li>Things that can be contradicted by character actions. It would be wrong to put that your character is sleeping under a bush when they`re active. If you do this, you need to be vigilant about updating your descriptions as necessary.\r\n</li>\r\n<li>Things that can be contradicted by future implementations. Mechanics always trump RP, so if your character puts in their description that they have a tattoo, and tattoos are later implemented, they would need to get a real tattoo to justify the description. The best way to judge if something will be implemented or not would be to check the suggestions forum (be sure to do a search first before posting again). If you do choose to risk descriptions like tattoos, etc, the gaining of said attributes should be role-played, not magically endowed.\r\n</li></ul>\r\n<p>Please exercise good judgment and common sense when using this feature. As summarized by Natso and Piscator on our forum: <i>Describe the physical, and perhaps habitual, details of your character, as though being viewed by an unbiased stranger.</i><b>  As a rule of thumb, don`t put anything in there you wouldn`t emote.</b></p> <p>You can report descriptions in violation of these guidelines with the button provided.</p>','','Doug R. <chippiemoose@gmail.com>','2010-03-24'),(1,1,'public_desc_guide_title','Guidelines for Custom Descriptions',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2010-02-28'),(1,1,'purge','Empty stomach',NULL,'Ilona Hyvttinen <okarrdess@yahoo.com>','2011-09-04'),(1,1,'raws_needed','Raw materials needed:','','Judith Meyer <junesun@gmx.net>','2005-11-13'),(1,1,'raw_aioli','aioli',NULL,'Resource Department <resources@cantr.net>','0000-00-00'),(1,1,'raw_akvavit','akvavit',NULL,'Resource Department <resources@cantr.net>','0000-00-00'),(1,1,'raw_alcohol','alcohol',NULL,'Resource Department <resources@cantr.net>','0000-00-00'),(