','2012-05-17'),(1,1,'survey_s_6','Communication between players and staff',NULL,'Survey manager','2013-05-29'),(1,1,'survey_s_7','Travel speed and tool disassembling',NULL,'Survey manager','2014-02-18'),(1,1,'survey_s_8','NCS Policy survey',NULL,'Survey manager','2018-05-11'),(1,1,'survey_s_9','test survey',NULL,'Survey manager','2018-05-26'),(1,1,'take_all_button','Take everything','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-04-03'),(1,1,'target_close','You are close.','','Wojciech Dorosz <wdorosz@gmail.com>','2006-02-28'),(1,1,'target_far_away','You are far away.','','Wojciech Dorosz <wdorosz@gmail.com>','2006-02-28'),(1,1,'target_very_close','You are very close.','','Wojciech Dorosz <wdorosz@gmail.com>','2006-02-28'),(1,1,'target_very_far_away','You are very far away.','','Wojciech Dorosz <wdorosz@gmail.com>','2006-02-28'),(1,1,'test_tag','This tag is for testing translations of various languages and character encodings. It does not need to be translated, but you can add some dummy translation to it, just to have it not appear on the list of untranslated content. /EchoMan','','Fredrik B. <fredrik@cantr.org>','2011-10-31'),(1,1,'text_animal_saddling','You are going to saddle this animal. This requires a saddle and will take some time. When the saddling is finished, the animal will become a mount, which can be used to travel.','','Pilot  <alf_pilot@yahoo.com>','2013-12-27'),(1,1,'text_animal_unsaddling','Unsaddling can be initiated only by the owner and, just like saddling, takes some time. To start unsaddling, nobody and nothing can be carried by this animal. When unsaddling is finished, you get animal and saddle back.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-04-26'),(1,1,'text_base_css_skin','Base CSS skin','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-11-29'),(1,1,'text_custom_css_skin','Custom CSS skin','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-11-29'),(1,1,'text_eat_from_container_effects','Result of eating #WEIGHT# grams','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-26'),(1,1,'text_ingest_for_state','for','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-06-15'),(1,1,'text_new_building_desc','Please note that building description should include only features or details which can exist or be supported by game options. These may include architectural details or decoration, placement of furniture, etc. They should not contain references to any objects that are not buildable, or are otherwise incompatible with game functions. Remember that information about a description\'s author is stored in the database and inappropriate ones can be reported using [!] button.','','Pilot  <pilot.cantr@gmail.com>','2015-01-25'),(1,1,'text_no_lock','no lock','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-11-18'),(1,1,'text_reactivation_mail_sent','A ractivation link has been sent to the email address #EMAIL# for this account.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2017-03-23'),(1,1,'text_recruitment','Click here if you are interested in joining the Cantr II staff!',NULL,'Jos Elkink <jos@cantr.net>','2004-02-11'),(1,1,'text_season_its','It\'s','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-10-30'),(1,1,'text_vehicle_disassembling','You are going to disassemble <CANTR LOCNAME ID=#VEHICLE#>. To do so, the construction you are going to destroy must be completely empty: it can\'t have any projects, people, objects or sublocations (extensions) inside. It takes some time and, when the project is finished, it returns to you a part of the resources used to build it.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-02-17'),(1,1,'text_vote','You are encouraged to vote for Cantr II on each of the sites below, once a day, every day!',NULL,'Jos Elkink <jos@cantr.net>','2004-09-16'),(1,1,'text_webzine','Visit the <a href=http://webzine.cantr.net>Cantr Webzine</a> and learn more about the game and from behind-the-scenes of Cantr!','','Fredrik B. <fredrik@cantr.org>','2010-11-22'),(1,1,'timeline_1','next hour in',NULL,'Jos Elkink <jos@cantr.net>','2003-03-11'),(1,1,'timeline_2','real-life minutes',NULL,'Jos Elkink <jos@cantr.net>','2003-03-11'),(1,1,'timeline_3','There are 20 days in a year, 8 hours in a day, 36 minutes in an hour and 60 seconds in a minute.','','Stefan Liedtke <Stelior@gmx.de>','2009-07-01'),(1,1,'tip_application_accepted_1','Your application has been accepted! Now you may go back to your characters list and finalize entering the main game. Remember that you don\'t have to do it now. If you want to learn more, then you can stay here longer.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-07'),(1,1,'tip_application_accepted_2','Click this button to return to the \"Characters List\" page.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-07'),(1,1,'tip_buildmenu_general','On this page you can see a list of items to manufacture. There are hundreds of them, but at first most are beyond your capabilities.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_buildmenu_sim','Remember that Cantr is a society simulator, so it emphasizes the value of cooperation between characters. Why create a new set of tools, when you can borrow them? Maybe instead of building a new vehicle it\'s better to buy a used one?','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_end','end','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-02'),(1,1,'tip_events_capital_rule_1','It\'s important to know that you should separate players from their characters. Your characters shouldn\'t know anything that they didn\'t learn in the game. That\'s the shortest explanation of the Capital Rule.','','Pilot  <pilot.cantr@gmail.com>','2014-08-23'),(1,1,'tip_events_capital_rule_2','You should treat your characters like an actor treats roles to play in the theatre or how players treat their characters in a role-playing game. Each character should have separate characteristics and goals.','','Pilot  <pilot.cantr@gmail.com>','2014-08-23'),(1,1,'tip_events_events','Here you can see the events that your character sees. New events appear automatically, so you don\'t have to refresh the page.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_events_general','This is the events page - the most important page of the game. Here you can see information about the actions of your character and characters controlled by other players.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-11-25'),(1,1,'tip_events_nav_panel','This is the most important navigation panel. By clicking on the buttons you can see your items, location, other people and current projects.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-02'),(1,1,'tip_events_your_chardesc','To see details about your character (skills, health, appearance) click on its name.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_explaination','This is a Cantr learning environment.<br>\r\nAll progress made in here will not carry over to the real game, and your test character will disappear after the tutorial.<br>\r\n<br>\r\nHere you may meet mentors which will answer any questions you might have about the game.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-08-04'),(1,1,'tip_inventory_agreements','You can similarly set names for unknown characters. In Cantr, the history, political systems, economy and laws are created by the characters. Reality in Cantr is created by agreements between characters.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_inventory_general','On this page you can see things carried by your character. Upon spawning your character doesn\'t have anything.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_inventory_notes','Most persistent information in Cantr is stored using notes. If you want to present or describe something interesting - create a new note. Creating a note is free. Remember that uneditable notes are really uneditable - they can never be destroyed.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_inventory_unknown_location','But let\'s take a look at the character info again. At the beginning, every location (just like people) is unknown to your character. By clicking on a location name you can decide how to remember it. Usually it\'s best to use a name commonly known by other people.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_location_animals','If your character is outside then there\'s a button to show the animals list. I STRONGLY ADVISE AGAINST starting the game by hunting. It can lead to antipathy of other characters and make it harder to learn about the game. Your characters can break in-game laws, but you should do so consciously.','','Pilot  <pilot.cantr@gmail.com>','2014-08-25'),(1,1,'tip_location_exit_routes','On the bottom of the page you\'ll see the a list of exit routes. As I\'ve mentioned earlier, travels happen in a turn based system, so even going to the road and turning around can take up to three hours. Don\'t do it without a reason. Travelling by foot is very slow and can take even a few days.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_location_general','Information presented on this page depends on the location your character is.','','Pilot  <pilot.cantr@gmail.com>','2014-08-25'),(1,1,'tip_location_in_building_vehicle','If your character is in a building or a vehicle then there will be a button to go outside.','','Pilot  <pilot.cantr@gmail.com>','2014-08-25'),(1,1,'tip_location_seasons','If your character is not inside a building, it will see the weather conditions. Every season in Cantr lasts about 20 days.','','Pilot  <pilot.cantr@gmail.com>','2014-08-25'),(1,1,'tip_next','next','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-02'),(1,1,'tip_people_attack','The attack button (shown as a star) allows hitting another character. This action is available starting on the fourth day of playing. What is perhaps surprising is that you can attack the same character only ONCE PER DAY, and this is because of the slow pace of the game. Not everyone is online all the time and this way even a less active player has time to react.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_people_death','Another thing different in Cantr is DEATH. People don\'t have to die from old age, but when a character dies then their death is final and permanent.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_people_drag','The dragging button (shown as a plus) allows forcing other chars to move to another location. It\'s a special type of project, because it doesn\'t have time requirements. It happens immediately when the aggressors have enough strength. It usually isn\'t possible to drag someone without other people\'s help.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-01'),(1,1,'tip_people_general','Here you can see all the characters nearby (including yours): characters in the same location, and those inside vehicles and buildings with an open window.','','Pilot  <pilot.cantr@gmail.com>','2014-08-25'),(1,1,'tip_people_remember','At the beginning, all characters - except your own - are strangers: you don\'t know their name. It\'s different than most games and something completely natural - you don\'t know someone\'s name before they introduce themselves, unless you find out in some other way.','','Pilot  <pilot.cantr@gmail.com>','2014-08-25'),(1,1,'tip_player_date_1','Here you can see the in-game time. One real day and one in-game day is the same, but that\'s all that\'s similar. One in-game hour is three real hours. By \"hour\" in this tutorial I mean a real hour.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_player_date_2','In Cantr, project and travel progress is sudden and calculated once every three hours. That\'s why your participation even in short projects isn\'t visible until after some time.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_player_help_icon','You can show these tips by clicking on this icon.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_player_welcome','Welcome to Cantr! I\'m your assistant and I\'ll be helping you learn the basic game rules and interface. You can see more help messages by clicking \'next\' or using the arrows  and .','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_player_your_char','This is your first character. Next to the character\'s name you can see sex, current location, and the progress of activities such as travel (T) and work (P). To enter your character\'s page click on this icon.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_prev','previous','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-02'),(1,1,'tip_projects_buildmenu','To create a project you can create it on a machine, start gathering resources or select the desired object in the <b>build menu</b> and meet the conditions to build it. Cantr has hundreds of objects: machines, tools, clothes and others. All things in the game were created by characters\' projects.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_projects_delete','The \"X\" button is to remove a project. Usually it returns already used resources, but it depends on the project type.','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_projects_details','Apart from its name, a project has a few indicators:  or x informs you if your character can make progress on a project (e.g. if your character has the required tools). Another is the percent of progress. Instead of a number it may show \"-\", which means that the project can\'t be started yet (e.g. from lack of resources). There\'s also the project initiator and the creation date.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-08'),(1,1,'tip_projects_general','Here you can see all the projects in the current location. Every time-consuming action in the game is represented by a project. Projects usually require some resources and objects, and more specialized projects also require machines and tools.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-01'),(1,1,'tip_projects_info','The button with the letter \"I\" leads to a page with the project\'s details (required time, tools, resources and other special requirements)','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_show_help','Show help','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-07-01'),(1,1,'tip_skip','skip','','Aleksander Chrabaszcz <grkalk@gmail.com>','2014-09-30'),(1,1,'tip_temp_lock_1','The registration mechanism has found some patterns in your data similar to a recently banned or refused player. They are most likely coincidental, but it requires manual verification to ensure better gaming experience for other players. Thanks for your patience.','','Joshua Mathias <Joshuamonkey@gmail.com>','2014-07-31'),(1,1,'title_account_pending','Registration complete!','','Aleksander Chrabaszcz <grkalk@gmail.com>','2012-01-23'),(1,1,'title_adjust_speed','ADJUST TRAVELLING SPEED',NULL,'Jos Elkink <jos@cantr.net>','2003-05-14'),(1,1,'title_alter_book_title','Alter title of a book','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-02-02'),(1,1,'title_alter_sailing','ALTER SAILING',NULL,'Judith Meyer <junesun@gmx.net>','2004-03-26'),(1,1,'title_animals','ANIMALS','','Aleksander Chrabaszcz <grkalk@gmail.com>','2015-04-26'),(1,1,'title_animal_saddling','Saddling animal','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-12-14'),(1,1,'title_animal_unsaddling','Unsaddling animal','','Aleksander Chrabaszcz <grkalk@gmail.com>','2013-12-14'),(1,1,'title_bind_book','Binding a book','','Aleksander Chrabaszcz <grkalk@gmail.com>','2016-02-02'),(1,1,'title_buildings','BUILDINGS',NULL,'Grzegorz Sojka','2006-05-01'),(1,1,'title_build_menu','BUILD MENU',NULL,'Jos Elkink <jos@cantr.n